/*Table structure for table `configuracion` */

DROP TABLE IF EXISTS `configuracion`;

CREATE TABLE `configuracion` (
  `Numero` int(10) unsigned NOT NULL auto_increment,
  `HoraCalculoDiario` time default NULL,
  `informante` varchar(200) default 'Sin informacion',
  `RutaFotoCliente` varchar(150) default 'c:\\mbs-prestamo\\FotosClientes\\',
  `rnc` varchar(15) default '130433623',
  `numeroasignado` varchar(5) default '00001',
  `secuencia` int(7) default '1',
  `fecha` date default NULL COMMENT 'de cuando fue enviado el archivo pagos electronicos',
  `Empresa` varchar(40) default NULL COMMENT 'nombre',
  `Direccion` varchar(60) default NULL,
  `telefono` varchar(40) default NULL,
  `tinteres` float NOT NULL default '0',
  `tmoratoria` float NOT NULL default '0',
  `tgastoslegales` float NOT NULL default '0',
  `NombreEquipo` varchar(50) NOT NULL default 'Ninguno',
  `ApagarEquipo` tinyint(1) NOT NULL default '0',
  `Tiporecibo` varchar(20) NOT NULL default 'Mini Printer',
  `RutaDisenador` varchar(200) default NULL,
  `VerComision` tinyint(1) NOT NULL default '1',
  `VerNotaCredito` tinyint(1) NOT NULL default '1',
  `VerSubTotal` tinyint(1) NOT NULL default '1',
  `VerTotalGeneral` tinyint(1) NOT NULL default '1',
  `VerIntePend` tinyint(1) NOT NULL default '1',
  `VerCapiPend` tinyint(1) NOT NULL default '1',
  `VerTotalPend` tinyint(1) NOT NULL default '1',
  `simbolo` varchar(5) NOT NULL default 'RD$',
  PRIMARY KEY  (`Numero`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

