  `FILTRO11` varchar(20) default NULL,
  `FILTRO12` varchar(20) default NULL,
  `FILTRO13` varchar(20) default NULL COMMENT 'fin subtotales',
  `FILTRO14` varchar(20) default NULL COMMENT 'excel agrupar',
  `FILTRO15` varchar(400) default NULL COMMENT 'campo que no saldran en excel',
  `FILTRO16` varchar(100) default NULL COMMENT 'excel rango',
  `FILTRO17` varchar(100) default NULL COMMENT 'excel formato',
  `FILTRO18` varchar(100) default NULL COMMENT 'excel rango',
  `FILTRO19` varchar(100) default NULL COMMENT 'excel formato',
  `FILTRO20` varchar(100) default NULL COMMENT 'excel rango',
  `FILTRO21` varchar(100) default NULL COMMENT 'excel formato',
  `FILTRO22` varchar(20) default NULL COMMENT 'subtotal',
  `FILTRO23` varchar(20) default NULL,
  `FILTRO24` varchar(20) default NULL,
  `FILTRO25` varchar(20) default NULL,
  `FILTRO26` varchar(20) default NULL,
  `FILTRO27` varchar(20) default NULL,
  `FILTRO28` varchar(20) default NULL,
  `FILTRO29` varchar(20) default NULL,
  `FILTRO30` varchar(20) default NULL COMMENT 'fin subtotal',
  `sumatoria` blob,
  `filtro31` varchar(100) NOT NULL COMMENT 'parametros',
  `filtro32` varchar(100) NOT NULL,
  `filtro33` varchar(100) NOT NULL,
  `filtro34` varchar(100) NOT NULL,
  `filtro35` varchar(100) NOT NULL,
  `filtro36` date NOT NULL default '2000-01-01' COMMENT 'fecha',
  `filtro37` date NOT NULL default '2000-01-01',
  `filtro38` date NOT NULL default '2000-01-01',
  `filtro39` date NOT NULL default '2000-01-01' COMMENT 'fecha',
