/*Data for the table `consulta` */

insert  into `consulta`(`reporte`,`Detalle`,`Procedimiento`,`FILTRO1`,`FILTRO2`,`FILTRO3`,`FILTRO4`,`FILTRO5`,`FILTRO6`,`FILTRO7`,`FILTRO8`,`FILTRO9`,`FILTRO10`,`FILTRO11`,`FILTRO12`,`FILTRO13`,`FILTRO14`,`FILTRO15`,`FILTRO16`,`FILTRO17`,`FILTRO18`,`FILTRO19`,`FILTRO20`,`FILTRO21`,`FILTRO22`,`FILTRO23`,`FILTRO24`,`FILTRO25`,`FILTRO26`,`FILTRO27`,`FILTRO28`,`FILTRO29`,`FILTRO30`,`sumatoria`,`filtro31`,`filtro32`,`filtro33`,`filtro34`,`filtro35`,`filtro36`,`filtro37`,`filtro38`,`filtro39`,`filtro40`,`empresa`,`campoempresa`) values ('RECIBOS CANCELADOS','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\n\r\nCREATE TABLE sumatoria\r\nSELECT m.UsuarioCancela Usuario, SUM(m.Cancelado) sMonto\r\nFROM maestrodepago m, consulta c \r\nWHERE m.fechacancela BETWEEN c.filtro36 AND c.filtro37\r\nAND c.reporte=\'recibos cancelados\'\r\nGROUP BY m.UsuarioCancela\r\nORDER BY m.UsuarioCancela;\r\n\r\n\r\nCREATE TABLE total\r\nSELECT  SUM(m.Cancelado) tMonto\r\nFROM maestrodepago m, consulta c \r\nWHERE m.fechacancela BETWEEN c.filtro36 AND c.filtro37\r\nAND c.reporte=\'recibos cancelados\';\r\n\r\n\r\nSELECT  m.usuariocancela Usuario, cl.nombre Cliente,  m.Prestamo,m.Numero Recibo, m.Cancelado Monto, smonto, m.FechaCancela Fecha, m.Nota Motivo,\r\nc.filtro36,c.filtro37, tMonto\r\nFROM maestrodepago m, consulta c, sumatoria s, total t, prestamo p, cliente cl \r\nWHERE m.fechacancela BETWEEN c.filtro36 AND c.filtro37\r\nand m.prestamo=p.numero and p.cliente=cl.numero\r\nAND s.usuario=m.UsuarioCancela\r\nAND c.reporte=\'recibos cancelados\'\r\nORDER BY m.UsuarioCancela, m.numero;\r\n\r\nDROP TABLE  sumatoria;\r\nDROP TABLE  total;\r\n\r\nEND','2014-11-01','2014-11-30','milagros tejada','','','','#,##0.00','e:e','5','5','5','5','5','1','filtro36,filtro37,tMonto,smonto,','g:g','mm/dd/yyyy',NULL,NULL,NULL,NULL,'5','5','5','5','5','5','5','5','5',NULL,'','','','','','2017-08-05','2017-08-24','2000-01-01','2000-01-01','2000-01-01',0,''),('CUADRE DIARIO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle\r\nSELECT   u.nombre Usuario, c.nombre Cliente,   m.Prestamo,  m.Numero Recibo, m.totalpagado Monto,  m.FechaHoy Fecha,\r\nco.filtro1,co.filtro36,co.filtro37\r\nFROM maestrodepago m, consulta co ,  usuario u, cliente c, prestamo p \r\nWHERE m.FechaHoy  between co.filtro36 and co.filtro37\r\nAND p.numero=m.prestamo -- para amarrar el cliente\r\nAND p.cliente=c.numero  -- para amarrar el cliente\r\nAND p.Estatus<>\'cancelado\'\r\nAND u.numero=m.Usuario\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE u.nombre=co.filtro1 END\r\nand m.estatus<>\'cancelado\' \r\nAND co.reporte=\'cuadre diario\'\r\nORDER BY m.Usuario,m.fecha;\r\n\r\n\r\nCREATE TABLE subtotal\r\nSELECT usuario , SUM(monto) smonto, count(distinct(recibo)) srecibo, count(distinct(cliente)) scliente,\r\ncount(distinct(prestamo)) sprestamo , count(distinct(fecha))  sfecha\r\nFROM detalle \r\nGROUP BY usuario; \r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(smonto) tmonto\r\nFROM subtotal; \r\n\r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(prestamo)) cprestamo, COUNT(DISTINCT(usuario)) cusuario, COUNT(DISTINCT(cliente)) ccliente\r\nFROM detalle;\r\n\r\n\r\nSELECT * FROM detalle d, subtotal s, total t, cantidad c\r\nWHERE d.usuario=s.usuario;\r\n\r\n\r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\n\r\nEND','ADELSON SÁNCHEZ','o','milagros tejada','','','','#,##0.00','e:e','5','5','5','5','5','1','co.filtro1,co.filtro36,co.filtro37,usuario_1,srecibo,smonto,tmonto,cprestamo,cusuario,scliente,ccliente,sprestamo,sfecha,','f:f','mm/dd/yyyy',NULL,NULL,NULL,NULL,'5','5','5','5','5','5','5','5','5',NULL,'','','','','','2019-02-18','2019-02-18','2000-01-01','2000-01-01','2000-01-01',0,''),('CUOTAS','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle\r\nSELECT pr.numero Prestamo, pr.cliente clie, cu.numero NumeroCuota, pr.plazo Plazo,   \r\n     cu.vencimiento Vencimiento,  cu.diasvencido DiasVencidos,  (pr.gastolegales/pr.montototal) * cu.capitalpendiente GastoLegal, \r\n     cu.mora Mora, cu.interespendiente Interes, cu.capitalpendiente Capital, cu.cuota Cuota,\r\n     cu.mora+cu.interespendiente+cu.capitalpendiente Pendiente,\r\n     CAST(CONCAT(cl.nombre,\' cel:\',cl.celular,\' tel:\',cl.telefono,\' Prestamo:\',pr.numero,\' (\',DATE_FORMAT(pr.Fecha,\'%d/%m/%Y\'),\')\') AS CHAR) AS Cliente,\r\n     co.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5    \r\nFROM prestamo pr, cuota cu, cliente cl, sucursal su, vendedor ve, empleador em, consulta co\r\nWHERE  \r\n	pr.sucursal=su.numero	\r\n	AND (ve.numero=pr.vendedor)\r\n	AND (pr.cliente=cl.numero)\r\n	AND cl.empleador=em.numero\r\n	AND pr.numero=cu.prestamo\r\n	AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END\r\n	AND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\n	AND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE ve.nombre=co.filtro3 END\r\n	AND CASE co.filtro4 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro4 END\r\n        AND CASE co.filtro5 WHEN \'Pendientes\' THEN  cu.interespendiente+capitalpendiente > 0\r\n                                     WHEN \'Vencidas\' THEN  cu.diasvencido>0\r\n                                     WHEN \'\' THEN  1=1 END\r\n	AND co.reporte=\'cuotas\'\r\n        AND pr.estatus NOT IN(\"CANCELADO\",\"SALDADO\")        \r\n      --  AND cu.estatus IN(\"ORIGINAL\",\"ABONADA\")\r\nGROUP BY pr.numero,cu.numero;\r\n     \r\n     \r\nCREATE TABLE subtotal\r\nSELECT prestamo, SUM(gastolegal) sgastolegal, SUM(mora) smora,  SUM(interes) sinteres,SUM(capital) scapital, SUM(cuota) scuota, SUM(pendiente) spendiente    \r\nFROM detalle\r\nGROUP BY prestamo;\r\n     \r\nCREATE TABLE total\r\nSELECT SUM(sgastolegal) tgastolegal, SUM(smora) tmora,  SUM(sinteres) tinteres,SUM(scapital) tcapital, SUM(scuota) tcuota, SUM(spendiente) tpendiente    \r\nFROM subtotal;\r\n     \r\n     \r\nCREATE TABLE cantidad     \r\nSELECT COUNT(DISTINCT(clie)) ccliente,  COUNT(DISTINCT(prestamo)) cprestamo\r\nFROM detalle;\r\n\r\n\r\nselect * from detalle d, subtotal s, total t, cantidad c \r\nwhere d.prestamo=s.prestamo; \r\n          \r\n                       \r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\n   \r\nEND','PRESTAMOS SANCHITO','','Perdida','','Pendientes','','#,##0.00','g:l','11','10','9','8','7','1','clie,filtro1,filtro2,filtro3,filtro4,filtro5,prestamo_1,sgastolegal,smora,sinteres,scapital,scuota,spendiente,tgastolegal,tmora,tinteres,tcapital,tcuota,tpendiente,ccliente,cprestamo,','e:e','mm/dd/yyyy',NULL,NULL,NULL,NULL,'12','12','12','12','12','12','12','12','12',NULL,'','','','','','2000-01-01','2000-01-01','2000-01-01','2000-01-01','2000-01-01',0,''),('PRESTAMOS','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle  \r\nSELECT pr.Numero prestamo, pr.fecha, pr.Vendedor vend, pr.cliente clie, ve.nombre Vendedor, cl.nombre Cliente, \r\n-- deuda\r\npr.gastolegales gasto, SUM(cu.mora) mora, SUM(cu.interes) interes, SUM(cu.interespendiente) interesp,\r\nSUM(cu.capital) capital, SUM(cu.capitalpendiente) capitalp, SUM(cu.mora+cu.interes+capital) deuda,\r\n-- pagado\r\n(SELECT SUM(totalpagado) FROM maestrodepago WHERE prestamo=cu.prestamo) pagado,\r\n-- saldo  \r\nSUM(cu.mora+cu.interespendiente+cu.capitalpendiente) saldo,\r\n-- parametros\r\nco.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37,co.filtro31\r\n\r\nFROM cuota cu, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, usuario u, consulta co\r\nWHERE cu.prestamo=pr.Numero\r\n AND pr.sucursal=su.numero	\r\n AND (pr.vendedor=ve.numero)\r\n AND (pr.cliente=cl.numero) \r\n AND cl.empleador=em.numero\r\n and pr.usuario=u.numero\r\n	\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\nAND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE  ve.nombre=co.filtro3 END\r\nAND CASE co.filtro5 WHEN \'\' THEN 1=1 ELSE u.nombre=co.filtro5 END\r\nAND CASE co.filtro4 WHEN \'\' THEN pr.estatus IN(\"Original\",\"Abonado\",\"Saldado\")\r\n                    WHEN \'Original y Abonado\' THEN pr.estatus IN(\"Original\",\"Abonado\") \r\n                    WHEN \'Legal\' THEN pr.estatus2 IN(\"Legal\") \r\n                    WHEN \'Castigado\' THEN pr.estatus2 IN(\"Castigado\") \r\n                    ELSE pr.estatus IN(co.filtro4) END\r\nAND pr.fecha BETWEEN co.filtro36 AND co.filtro37\r\nAND CASE co.filtro31 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro31 END	\r\nAND co.reporte=\'prestamos\'\r\nGROUP BY cu.prestamo;\r\n\r\n\r\n\r\n\r\n CREATE TABLE subtotal\r\n SELECT vend, SUM(gasto) sgasto, SUM(mora) smora, SUM(interes) sinteres, SUM(interesp) sinteresp, SUM(capital) scapital, SUM(capitalp) scapitalp, \r\n SUM(deuda) sdeuda, SUM(pagado) spagado, SUM(saldo) ssaldo, count(distinct(cliente)) scliente, count(distinct(prestamo)) sprestamo    \r\n FROM detalle\r\n GROUP BY vendedor ;\r\n   \r\n      \r\n CREATE TABLE total\r\n SELECT SUM(sgasto) tgasto, SUM(smora) tmora, SUM(sinteres) tinteres, SUM(sinteresp) tinteresp, SUM(scapital) tcapital, SUM(scapitalp) tcapitalp, \r\n SUM(sdeuda) tdeuda, SUM(spagado) tpagado, SUM(ssaldo) tsaldo   \r\n FROM subtotal;\r\n       \r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(prestamo) cprestamo, COUNT(DISTINCT(vend)) cvendedor, COUNT(DISTINCT(clie)) ccliente\r\nFROM detalle;      \r\n\r\nSELECT * FROM detalle d,subtotal s,total t,cantidad c\r\nWHERE d.vend=s.vend\r\norder by d.vend, d.fecha;\r\n\r\nDROP TABLE IF EXISTS detalle;\r\nDROP TABLE IF EXISTS subtotal;\r\nDROP TABLE IF EXISTS total;\r\nDROP TABLE IF EXISTS cantidad;\r\n\r\nEND','PRESTAMOS SANCHITO','','','','','','mm/dd/yyyy','b:b','11','10','9','8','7','5','vend,clie,filtro1,filtro2,filtro3,filtro4,filtro5,filtro36,filtro37,filtro31,vend_1,sgasto,smora,sinteres,sinteresp,scapital,scapitalp,sdeuda,spagado,ssaldo,tgasto,tmora,tinteres,tinteresp,tcapital,tcapitalp,tdeuda,tpagado,tsaldo,cprestamo,cvendedor,ccliente,scliente,sprestamo,','g:o','#,##0.00',NULL,NULL,NULL,NULL,'12','13','14','15','15','15','15','15','15',NULL,'','','','','','2019-05-07','2019-05-08','2000-01-01','2000-01-01','2000-01-01',0,''),('DESCUENTO NOMINA','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle\r\n      SELECT em.nombre Empleador,\r\n	pr.numero Prestamo,\r\n	cl.nombre Cliente, \r\n	cu.numero NumeroCuota, cu.vencimiento Vencimiento, cu.interespendiente Interes, cu.capitalpendiente Capital, cu.cuota Cuota ,\r\n	co.filtro1,co.filtro36,co.filtro37\r\n      FROM prestamo pr, cuota cu, cliente cl, empleador em, consulta co\r\n      WHERE pr.estatus IN(\"ORIGINAL\",\"ABONADO\") \r\n      AND pr.numero=cu.prestamo\r\n      AND pr.cliente=cl.numero \r\n      AND cl.empleador=em.numero       \r\n      AND cu.vencimiento BETWEEN co.filtro36 AND co.filtro37\r\n      AND (cu.interespendiente + cu.capitalpendiente > 0)\r\n      AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE em.Nombre=co.FILTRO1 END \r\n      AND co.reporte=\'descuento nomina\'\r\n      ORDER BY em.nombre, pr.Numero, cu.Numero ;\r\n      \r\nCREATE TABLE subtotal      \r\n      SELECT empleador, SUM(interes) sinteres, SUM(capital) scapital, SUM(cuota) scuota,\r\n      count(distinct(cliente)) scliente,  count(distinct(prestamo)) sprestamo\r\n      FROM detalle \r\n      GROUP BY empleador;\r\n      \r\nCREATE TABLE total      \r\n      SELECT SUM(sinteres) tinteres, SUM(scapital) tcapital, SUM(scuota) tcuota\r\n      FROM subtotal;\r\n      \r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(prestamo)) cprestamo, COUNT(DISTINCT(empleador)) cempleador, COUNT(DISTINCT(cliente)) ccliente\r\nFROM detalle;         \r\n      \r\n      SELECT * FROM detalle d, subtotal s, total t, cantidad c\r\n      WHERE d.Empleador=s.empleador;\r\n      \r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;      \r\nDROP TABLE cantidad;\r\n       \r\n\r\nEND','PRESTAMOS SANCHITO','2014-01-01','2014-12-31','','','','mm/dd/yyyy','e:e','8','8','8','7','6','1','empleador_1,sinteres,scapital,scuota,tinteres,tcapital,tcuota,filtro1,filtro36,filtro37,cprestamo,cempleador,ccliente,scliente,sprestamo,','f:h','#,##0.00',NULL,NULL,NULL,NULL,'8','8','8','8','8','8','8','8','8',NULL,'','','','','','2019-03-12','2019-04-11','2000-01-01','2000-01-01','2000-01-01',0,''),('CHEQUES','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\ncreate table detalle\r\nSELECT ch.chequera, ch.fecha,  ch.cheque, ch.cliente Beneficiario, ch.monto,\r\nco.filtro1,co.filtro36,co.filtro37\r\nFROM cheque ch, sucursal su, consulta co\r\nWHERE ch.Sucursal=su.Numero\r\nAND ch.Estatus=\'original\'\r\nAND ch.Fecha BETWEEN co.filtro36 AND co.filtro37\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.Nombre=co.filtro1 END\r\nAND co.reporte=\'cheques\'\r\nORDER BY ch.Chequera, ch.Fecha;\r\n\r\ncreate table total\r\nselect sum(monto) tmonto from detalle;\r\n\r\nselect * from detalle,total\r\norder by chequera,fecha;\r\n\r\ndrop table detalle;\r\ndrop table total;\r\n\r\nEND','CREDIFASSIL','2012-07-01','2014-07-31','','','','#,##0.00','e:e','5','5','5','5','5','1','filtro1,filtro36,filtro37,tmonto,','b:b','mm/dd/yyyy',NULL,NULL,NULL,NULL,'5','5','5','5','5','5','5','5','5',NULL,'','','','','','2014-07-01','2014-07-31','2000-01-01','2000-01-01','2000-01-01',0,''),('INGRESOS FUTURO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE Detalle1 \r\nSELECT pr.numero Prestamo, cl.nombre Cliente,\r\nCASE MONTH(cu.vencimiento) WHEN 1 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Enero, \r\n \r\nCASE MONTH(cu.vencimiento) WHEN 2 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Febrero,  \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 3 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Marzo,\r\n \r\nCASE MONTH(cu.vencimiento) WHEN 4 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Abrir, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 5 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Mayo, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 6 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Junio, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 7 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Julio, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 8 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Agosto, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 9 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Septiembre, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 10 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Octubre, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 11 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Noviembre, \r\n\r\nCASE MONTH(cu.vencimiento) WHEN 12 THEN\r\n     CASE co.filtro5 WHEN \'\' THEN  cu.interespendiente+cu.capitalpendiente\r\n                     WHEN \'Solo interes\' THEN  cu.interespendiente\r\n                     WHEN \'Solo capital\' THEN  cu.capitalpendiente \r\n     END\r\nELSE 0 END Diciembre,\r\nco.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro6,\r\nem.numero empleador, ve.numero vendedor, su.numero sucursal\r\n                            \r\nFROM prestamo pr, cuota cu, sucursal su, empleador em, vendedor ve, cliente cl,  consulta co\r\nWHERE pr.numero=cu.prestamo\r\nAND pr.sucursal=su.numero\r\nAND pr.vendedor=ve.numero\r\nAND pr.cliente=cl.numero\r\nAND cl.empleador=em.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\nAND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE ve.nombre=co.filtro3 END\r\nAND CASE co.filtro4 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro4 END\r\nAND pr.estatus IN(\'original\',\'abonado\')\r\nAND co.reporte=\'ingresos futuro\'\r\nAND YEAR(cu.vencimiento)=co.filtro6\r\nORDER BY cu.vencimiento;\r\n\r\n\r\n\r\nCREATE TABLE detalle\r\nSELECT \'-->\' total, Prestamo, Cliente,  SUM(enero) Enero, SUM(Febrero) Febrero, SUM(marzo) Marzo, SUM(abrir) Abrir,\r\nSUM(mayo) Mayo, SUM(junio) Junio, SUM(julio) Julio, SUM(agosto) Agosto, SUM(septiembre) Septiembre,\r\nSUM(octubre) Octubre, SUM(noviembre) Noviembre, SUM(diciembre) Diciembre,\r\nfiltro1,filtro2,filtro3,filtro4,filtro5,filtro6\r\nFROM detalle1\r\nGROUP BY prestamo;\r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(enero) tEnero, SUM(Febrero) tFebrero, SUM(marzo) tMarzo, SUM(abrir) tAbrir,\r\nSUM(mayo) tMayo, SUM(junio) tJunio, SUM(julio) tJulio, SUM(agosto) tAgosto, SUM(septiembre) tSeptiembre,\r\nSUM(octubre) tOctubre, SUM(noviembre) tNoviembre, SUM(diciembre) tDiciembre \r\nFROM detalle;\r\n\r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(prestamo)) cprestamo, COUNT(DISTINCT(empleador)) cempleador,\r\nCOUNT(DISTINCT(vendedor)) cvendedor, COUNT(DISTINCT(cliente)) ccliente\r\nFROM detalle1;\r\n\r\n\r\nSELECT * FROM detalle, total, cantidad; \r\n\r\nDROP TABLE detalle1;\r\nDROP TABLE detalle;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\n                       \r\n\r\nEND','PRESTAMOS SANCHITO','','','','','2019','#,##0.00','d:o','8','7','6','5','4','1','filtro1,filtro2,filtro3,filtro4,filtro5,filtro6,tEnero,tFebrero,tMarzo,tAbrir,tMayo,tJunio,tJulio,tAgosto,tSeptiembre,tOctubre,tNoviembre,tDiciembre,cprestamo,cempleador,cvendedor,ccliente,','','',NULL,NULL,NULL,NULL,'9','10','11','12','13','14','15','15','15',NULL,'','','','','','2000-01-01','2000-01-01','2000-01-01','2000-01-01','2000-01-01',0,''),('CARTERA DE PRESTAMO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\n       \r\n-- creo la tabla insertando la deuda total\r\nCREATE TABLE detalle \r\nSELECT p.Numero Prestamo, Cl.nombre Cliente,\r\nSUM(c.capitalpendiente) deuda,\r\n0 CuotaVencida, 0 interesvencido, 000000000000.00 a, 000000000000.00 b, 000000000000.00 c, 000000000000.00 d, 000000000000.00 e, 000000000000.00 f,\r\nco.filtro1,co.filtro2\r\nFROM cuota c, prestamo p, vendedor v, sucursal s, cliente cl, consulta co\r\nWHERE p.vendedor=v.numero AND p.sucursal=s.numero\r\nAND p.cliente=cl.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE v.nombre=co.filtro2 END\r\nAND p.Numero=c.Prestamo AND p.estatus  IN(\'ORIGINAL\',\'ABONADO\')  \r\nAND p.estatus2<>\'CASTIGADO\'\r\nAND co.reporte=\'Cartera de prestamo\'\r\nGROUP BY p.Numero\r\nHAVING SUM(c.capitalpendiente) > 1; \r\n\r\n-- inserto la cuotavencidas por prestamo\r\nINSERT INTO detalle(prestamo,cuotavencida) \r\nSELECT p.numero, COUNT(*)\r\nFROM cuota c, prestamo p, vendedor v, sucursal s, consulta co\r\nWHERE p.vendedor=v.numero AND p.sucursal=s.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE v.nombre=co.filtro2 END\r\nAND p.Numero=c.Prestamo AND p.estatus  IN(\'ORIGINAL\',\'ABONADO\')  \r\nAND p.estatus2<>\'CASTIGADO\'\r\nAND c.diasvencido > 0 AND c.estatus<>\'Saldada\'\r\nAND co.reporte=\'Cartera de prestamo\'\r\nGROUP BY p.Numero; \r\n\r\n\r\n-- inserto el interes actual por prestamo\r\nINSERT INTO detalle(prestamo,interesvencido) \r\nSELECT p.numero,SUM(c.interespendiente) \r\nFROM cuota c, prestamo p, vendedor v, sucursal s, consulta co\r\nWHERE p.vendedor=v.numero AND p.sucursal=s.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE v.nombre=co.filtro2 END\r\nAND p.Numero=c.Prestamo AND p.estatus  IN(\'ORIGINAL\',\'ABONADO\')  \r\nAND p.estatus2<>\'CASTIGADO\'\r\nAND ( diasconcuota(c.vencimiento,NOW(),p.sepaga) BETWEEN 1 AND sepaga(p.sepaga))\r\nAND co.reporte=\'Cartera de prestamo\'\r\nGROUP BY p.Numero; \r\n\r\n\r\n\r\n-- aqui inserto el monto entre plazo\r\nINSERT INTO detalle(prestamo,a,b,c,d,e,f)  \r\nSELECT p.numero, \r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 1 AND 30 THEN    c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END a,\r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 31 AND 60 THEN   c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END b,\r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 61 AND 90 THEN   c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END c,\r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 91 AND 120 THEN  c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END d,\r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 121 AND 180 THEN c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END e,\r\nCASE WHEN c.diasvencido+c.diaspago BETWEEN 181 AND 360 THEN c.mora+c.interespendiente+c.capitalpendiente ELSE 0.00 END f\r\nFROM cuota c, prestamo p, vendedor v, sucursal s, consulta co\r\nWHERE p.vendedor=v.numero AND p.sucursal=s.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE v.nombre=co.filtro2 END\r\nAND p.Numero=c.Prestamo AND p.estatus  IN(\'ORIGINAL\',\'ABONADO\') \r\nAND c.diasvencido>0\r\nand p.estatus2<>\'CASTIGADO\' \r\nAND c.estatus<>\'Saldada\'\r\nAND co.reporte=\'Cartera de prestamo\'; \r\n\r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(deuda) tDeuda,SUM(deuda)+SUM(interesvencido) td, SUM(a) t0_30, SUM(b) t31_60, SUM(c) t61_90, SUM(d) t91_120, SUM(e) t121_180, SUM(f) t181_360\r\nFROM detalle;\r\n\r\n\r\n\r\nCREATE TABLE PorcientoMora\r\nSELECT  (t0_30+t31_60+t61_90+t91_120+t121_180+t181_360)/tDeuda mdeuda,\r\n             t0_30/tDeuda m0_30,\r\n             t31_60/tDeuda m31_60,\r\n             t61_90/tDeuda m61_90,\r\n             t91_120/tDeuda m91_120,\r\n             t121_180/tDeuda m121_180,\r\n             t181_360/tDeuda m181_360\r\nFROM total;  \r\n\r\n\r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(cliente)) ccliente, COUNT(DISTINCT(prestamo)) cprestamo FROM detalle;\r\n\r\n\r\n\r\nSELECT \'-\' total, d.cliente, d.Prestamo, SUM(d.deuda) Deuda, SUM(d.cuotavencida) Cuotasvencidas, SUM(d.a) 0_30, SUM(d.b) 31_60, SUM(d.c) 61_90, \r\nSUM(d.d) 91_120, SUM(d.e) 121_180, SUM(d.f) 181_360, t.*, c.*,p.*,d.filtro1,d.filtro2\r\nFROM detalle d, total t, cantidad c, porcientomora p\r\nGROUP BY d.prestamo\r\nORDER BY d.cliente,d.prestamo;\r\n    \r\n    \r\n\r\nDROP TABLE detalle;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\nDROP TABLE porcientomora; \r\n\r\n\r\n      \r\n\r\nEND','Prestamos Sanchito','','','','','2015','#,##0.00','d:d','9','8','7','6','4','1','tDeuda,t0_30,t31_60,t61_90,t91_120,t121_180,t181_360,ccliente,cprestamo,filtro1,filtro2,mdeuda,m0_30,m31_60,m61_90,m91_120,m121_180,m181_360,','f:m','#,##0.00',NULL,NULL,NULL,NULL,'10','11','11','11','11','11','11','11','11',NULL,'','','','','','2000-01-01','2000-01-01','2000-01-01','2000-01-01','2000-01-01',0,''),('DATACREDITO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\nDROP TABLE if exists datacredito;\r\n         DROP TABLE  if exists copia;\r\n          DROP TABLE  if exists copia2;\r\n\r\n\r\n	CREATE TABLE DataCredito\r\n	(\r\n		Prestamo 		INT,\r\n		Cliente 		INT,\r\n		Nombre			VARCHAR(40),\r\n		Cedula			VARCHAR(15),\r\n		Direccion		VARCHAR(60),\r\n		Telefono1		VARCHAR(20),\r\n		Telefono2		VARCHAR(20),\r\n		TipoRelaccion		INT,\r\n		Estatus			VARCHAR(15),\r\n		FechaApertura		DATE,\r\n		TipoPrestamo		VARCHAR(1)\r\n	);\r\n\r\n	   \r\n		INSERT INTO DataCredito(Prestamo,cliente,NOMBRE,CEDULA, DIRECCION,TELEFONO1,TELEFONO2,TipoRelaccion,ESTATUS,fechaapertura,tipoprestamo)				\r\n		SELECT p.numero, c.numero, c.nombre, CONCAT(\' \',c.cedula) cedula, c.direccion, c.telefono, c.celular, 1 , p.estatusdc, p.fecha,\r\n		CASE p.tipoprestamo 	WHEN \'DE CONSUMO\' THEN \'N\'  \r\n					WHEN \'HIPOTECARIO \' THEN \'V\' \r\n					WHEN \'MICROCREDITO\' THEN \'M\' \r\n					WHEN \'OTRO\' THEN \'-\' \r\n		END \r\n		FROM prestamo p, cliente c, sucursal s, consulta co\r\n		WHERE p.cliente=c.numero AND p.estatus IN(\'ORIGINAL\',\'ABONADO\',\'SALDADO\')		\r\n		AND P.EnDataCredito=FALSE\r\n		AND p.sucursal=s.numero\r\n		AND  CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\n		AND co.reporte=\'DATACREDITO\';\r\n\r\n	\r\n	\r\n	CREATE TABLE copia\r\n	(\r\n		Prestamo 		INT,\r\n		MontoFormalizado 	DOUBLE(12,2),\r\n		BalanceAlDia		DOUBLE(12,2),\r\n		MontoAtraso		DOUBLE(12,2),\r\n		Cuota			DOUBLE(12,2),\r\n		FechaVencimiento	DATE,\r\n		FechaUltimoPago	 	DATE\r\n	);\r\n		\r\n	\r\n    	INSERT INTO copia(prestamo, montoformalizado)\r\n	SELECT p.numero, p.monto FROM prestamo p, datacredito d WHERE p.numero=d.prestamo ORDER BY p.numero;\r\n	\r\n	INSERT INTO copia(prestamo, cuota)\r\n	SELECT d.prestamo, MIN(c.cuota)  FROM cuota c, datacredito d WHERE c.prestamo=d.prestamo  GROUP BY d.prestamo;\r\n	\r\n 	INSERT INTO copia(prestamo, BalanceAlDia)\r\n	SELECT d.prestamo,SUM(c.mora+c.interespendiente+c.capitalpendiente) FROM cuota c, datacredito d WHERE c.prestamo=d.prestamo GROUP BY d.prestamo;\r\n	\r\n	INSERT INTO copia(prestamo, montoatraso)\r\n        SELECT d.prestamo,SUM(c.mora+c.interespendiente+c.capitalpendiente) FROM cuota c, datacredito d WHERE c.prestamo=d.prestamo AND c.diasvencido > 0  GROUP BY d.prestamo;	\r\n	\r\n        INSERT INTO copia(prestamo, fechavencimiento)\r\n	SELECT d.prestamo, MAX(c.vencimiento) FROM cuota c, datacredito d WHERE c.prestamo=d.prestamo GROUP BY d.prestamo;\r\n	\r\n	INSERT INTO copia(prestamo, fechaultimopago)\r\n	SELECT d.prestamo, MAX(m.fecha) FROM maestrodepago m, datacredito d WHERE m.prestamo=d.prestamo GROUP BY d.prestamo;\r\n	\r\n	\r\n	\r\n        CREATE TABLE copia2	\r\n        SELECT prestamo, MAX(montoformalizado) montoformalizado,MAX(balancealdia) balancealdia, MAX(montoatraso) montoatraso ,MAX(cuota) cuota, \r\n        MAX(fechavencimiento) fechavencimiento, MAX(fechaultimopago) fechaultimopago  FROM copia GROUP BY prestamo ORDER BY prestamo	;\r\n\r\n	 		\r\n	UPDATE prestamo p, datacredito d SET p.EnDataCredito=TRUE \r\n	WHERE 	p.numero=d.prestamo AND d.estatus=\'S\';\r\n	       		\r\n        insert into datacreditoenviado(prestamo,clave) \r\n        SELECT d.prestamo,c.filtro2 FROM datacredito d, consulta c\r\n        WHERE c.reporte=\"DataCredito\" AND d.estatus=\'S\';\r\n	       		\r\n        SELECT d.Prestamo,Cliente,Nombre,Cedula,Direccion,Telefono1,Telefono2,tiporelaccion RelaccionTipo,Estatus,BalanceAlDia,MontoAtraso,\r\n        Cuota, FechaApertura, FechaVencimiento, FechaUltimoPago, TipoPrestamo \r\n        FROM DataCredito d, copia2 c WHERE  d.Prestamo=c.prestamo ORDER BY cliente, d.prestamo;\r\n        \r\n\r\n        DROP TABLE datacredito;\r\n         DROP TABLE copia;\r\n          DROP TABLE copia2;\r\nEND','CREDIFASSIL','20160623 5','2014-07-31','','','','#,##0.00','j:l','','','','','','','','m:o','mm/dd/yyyy','','',NULL,NULL,'','','','','','','','','',NULL,'','','','','','2000-01-01','2000-01-01','2000-01-01','2000-01-01','2000-01-01',0,''),('SEGURO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\n	CREATE TEMPORARY TABLE Seguro\r\n	(\r\n		Prestamo 		INT,\r\n		Cliente 		INT,\r\n		Nombre			VARCHAR(40),\r\n		FechaNacimiento 	DATE,\r\n		Cedula			VARCHAR(15),\r\n		Direccion		VARCHAR(60),\r\n		Telefono1		VARCHAR(20),\r\n		Telefono2		VARCHAR(20),\r\n		TipoRelaccion		INT,\r\n		TiempoFaltante	 	DOUBLE(12,2),\r\n		MontoFormalizado 	DOUBLE(12,2),\r\n		Estatus			VARCHAR(15),\r\n		BalanceAlDia		DOUBLE(12,2),\r\n		MontoAtraso		DOUBLE(12,2),\r\n		Cuota			DOUBLE(12,2),\r\n		FechaApertura		DATE,\r\n		FechaVencimiento	DATE,\r\n		FechaUltimoPago	 	DATE,\r\n		TipoPrestamo		VARCHAR(1)\r\n	);\r\n	\r\n\r\n	INSERT INTO Seguro(Prestamo,cliente,NOMBRE,FechaNacimiento,CEDULA, DIRECCION,TELEFONO1,TELEFONO2,TipoRelaccion,ESTATUS,fechaapertura,Tipoprestamo)\r\n	SELECT p.numero,c.numero,c.nombre,c.fechaNacimiento,c.cedula,c.direccion,c.telefono,c.celular,1,p.estatusdc,p.fecha,p.tipoprestamo\r\n	FROM prestamo p, cliente c, sucursal s, consulta co\r\n	WHERE p.cliente=c.numero AND p.estatus IN(\'ORIGINAL\',\'ABONADO\',\'SALDADO\') \r\n	AND P.monto>15000 AND P.FECHA BETWEEN co.filtro2 AND co.filtro3\r\n	AND p.sucursal=s.numero\r\n	AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\n	AND co.reporte=\'seguro\';\r\n		\r\n\r\n	\r\n	UPDATE Seguro S SET \r\n	S.TiempoFaltante=(SELECT ROUND(DATEDIFF((SELECT vencimiento FROM cuota WHERE prestamo=s.prestamo ORDER BY numero DESC LIMIT 1),NOW())/30)),\r\n	S.montoformalizado=(SELECT monto FROM prestamo WHERE numero=S.prestamo),\r\n	S.cuota=(SELECT cuota FROM cuota WHERE numero=1 AND prestamo=S.prestamo),\r\n	S.BalanceAlDia=(SELECT SUM(mora+interespendiente+capitalpendiente) FROM cuota WHERE prestamo=S.prestamo),\r\n	S.montoatraso=(SELECT SUM(mora+interespendiente+capitalpendiente) FROM cuota WHERE prestamo=S.prestamo AND diasvencido+diaspago > 0),\r\n	S.fechavencimiento=(SELECT vencimiento FROM cuota WHERE prestamo=S.prestamo ORDER BY numero DESC LIMIT 1),\r\n	S.fechaultimopago=(SELECT fecha FROM maestrodepago WHERE prestamo=S.prestamo ORDER BY numero DESC LIMIT 1);		\r\n	\r\n        SELECT * FROM SEGURO ORDER BY cliente,prestamo;\r\n        \r\n        DROP TABLE seguro;\r\nEND','CREDIFASSIL','2012-07-01','2014-07-31','','','','#,##0.00','k:k,m:o','','','','','','','','d:d,p:r','mm/dd/yyyy',NULL,NULL,NULL,NULL,'','','','','','','','','',NULL,'','','','','','2017-05-01','2017-05-25','2000-01-01','2000-01-01','2000-01-01',0,''),('CLIENTES','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nSELECT c.numero,c.nombre,c.cedula,c.celular,c.puesto,c.sector,c.residencia,co.filtro1\r\nFROM cliente c, empleador e, consulta co \r\nWHERE c.Empleador=e.Numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE e.nombre=co.filtro1 END\r\nAND co.reporte=\'clientes\';\r\n\r\nEND','','2012-07-01','2014-07-31','','','','','','','','','','','','filtro1,','','',NULL,NULL,NULL,NULL,'','','','','','','','','',NULL,'','','','','','2014-07-01','2014-07-31','2000-01-01','2000-01-01','2000-01-01',0,''),('CUOTAS AGREGADAS','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\ncreate table detalle\r\nSELECT c.*,cl.nombre cliente,\r\nco.filtro1,co.filtro36,co.filtro37\r\nFROM cuotaagregada c, sucursal su, cliente cl, prestamo p,   consulta co\r\nWHERE c.Fecha BETWEEN co.filtro36 AND co.filtro37\r\nand p.cliente=cl.numero\r\nand c.prestamo=p.numero\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.Nombre=co.filtro1 END\r\nAND co.reporte=\'cuotas agregadas\'\r\nORDER BY c.usuario,c.fecha;\r\n\r\ncreate table total\r\nselect sum(monto) tmonto from detalle;\r\n\r\nselect * from detalle,total\r\norder by usuario,fecha,hora;\r\n\r\ndrop table detalle;\r\ndrop table total;\r\n\r\nEND','EMPRESA DE PR','2012-07-01','2014-07-31','','','','#,##0.00','d:d','','','','','','','filtro1,filtro36,filtro37,tmonto,numero,','e:f','mm/dd/yyyy',NULL,NULL,NULL,NULL,'','','','','','','','','',NULL,'','','','','','2018-10-11','2018-11-10','2000-01-01','2000-01-01','2000-01-01',0,''),('INICIALES','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle\r\nSELECT   s.nombre sucursal, c.nombre Cliente,   p.numero Prestamo, p.inicial Monto,  p.Fecha Fecha,\r\nco.filtro1,co.filtro36,co.filtro37\r\nFROM consulta co ,  sucursal s, cliente c, prestamo p \r\nWHERE p.fecha  BETWEEN co.filtro36 AND co.filtro37\r\nAND p.cliente=c.numero  -- para amarrar el cliente\r\nAND p.Estatus<>\'cancelado\'\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE s.nombre=co.filtro1 END\r\nAND co.reporte=\'iniciales\'\r\nand p.inicial >0\r\nORDER BY p.fecha,p.numero;\r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(monto) tmonto\r\nFROM detalle; \r\n\r\n\r\n\r\nSELECT * FROM detalle d, total t;\r\n\r\n\r\nDROP TABLE detalle;\r\nDROP TABLE total;\r\n\r\nEND','EMPRESA DE PR','o','milagros tejada','','','','mm/dd/yyyy','e:e','4','4','4','4','4','1','filtro1,filtro36,filtro37,tmonto,','d:d','#,##0.00',NULL,NULL,NULL,NULL,'4','4','4','4','4','4','4','4','4',NULL,'','','','','','2018-10-11','2018-11-10','2000-01-01','2000-01-01','2000-01-01',0,''),('CUENTA X COBRAR','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\ndrop table if exists detalle;\r\n\r\nCREATE TABLE detalle\r\n      SELECT em.nombre Empleador,\r\n	pr.numero Prestamo,\r\n	cl.nombre Cliente, \r\n	cu.numero NumeroCuota, cu.vencimiento Vencimiento, cu.interespendiente Interes, cu.capitalpendiente Capital, cu.cuota Cuota ,\r\n              cu.interespendiente+cu.capitalpendiente pendiente,\r\n	co.filtro1,co.filtro36,co.filtro37\r\n      FROM prestamo pr, cuota cu, cliente cl, empleador em, consulta co\r\n      WHERE pr.estatus IN(\"ORIGINAL\",\"ABONADO\") \r\n      AND pr.numero=cu.prestamo\r\n      AND pr.cliente=cl.numero \r\n      AND cl.empleador=em.numero       \r\n      AND cu.vencimiento BETWEEN co.filtro36 AND co.filtro37\r\n      AND (cu.interespendiente + cu.capitalpendiente >= 1)\r\n      AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE em.Nombre=co.FILTRO1 END \r\n      AND co.reporte=\'CUENTA X COBRAR\'\r\n      ORDER BY em.nombre, pr.Numero, cu.Numero ;\r\n      \r\nCREATE TABLE subtotal      \r\n      SELECT cliente, SUM(interes) sinteres, SUM(capital) scapital, SUM(cuota) scuota, SUM(pendiente) spendiente,\r\n      count(distinct(cliente)) scliente,  count(distinct(prestamo)) sprestamo\r\n      FROM detalle \r\n      GROUP BY cliente;\r\n      \r\nCREATE TABLE total      \r\n      SELECT SUM(sinteres) tinteres, SUM(scapital) tcapital, SUM(scuota) tcuota, SUM(spendiente) tpendiente\r\n      FROM subtotal;\r\n      \r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(prestamo)) cprestamo, COUNT(DISTINCT(empleador)) cempleador, COUNT(DISTINCT(cliente)) ccliente\r\nFROM detalle;         \r\n      \r\n      SELECT * FROM detalle d, subtotal s, total t, cantidad c\r\n      WHERE d.cliente=s.cliente\r\n      order by d.cliente,d.prestamo,d.NumeroCuota;\r\n      \r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;      \r\nDROP TABLE cantidad;\r\n       \r\n\r\nEND','','2014-01-01','2014-12-31','','','','mm/dd/yyyy','e:e','8','8','8','7','6','1','empleador_1,sinteres,scapital,scuota,tinteres,tcapital,tcuota,filtro1,filtro36,filtro37,cprestamo,cempleador,ccliente,scliente,sprestamo,spendiente,','f:h','#,##0.00',NULL,NULL,NULL,NULL,'8','8','8','8','8','8','8','8','8',NULL,'','','','','','2016-04-04','2019-05-04','2000-01-01','2000-01-01','2000-01-01',0,''),('INGRESOS X CLIENTE','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\n-- este detalle incluye las notas de credito\r\nCREATE TABLE detalle  \r\nSELECT -- esto es para la tabla cantidad\r\n      em.Nombre empleador, ve.nombre vendedor,\r\n      cl.nombre Cliente,     \r\n      pr.numero Prestamo, mp.numero Recibo,  mp.fecha Fecha, mp.comision Comision,       \r\n      mp.notadecredito Notacredito, \r\n       SUM(IF(dp.nota=\"Nota de credito\",0,(pr.gastolegales/pr.montototal) * dp.capital)) Gastoslegales, \r\n      mp.mora Mora, \r\n                                                      \r\n      -- el interes y el capital tienen la nota de credito incluida. por lo que estos dos campos no son muy confiables\r\n      dp.nota,\r\n      SUM(IF(dp.nota=\"Nota de credito\",0,dp.interes)) Interes, \r\n      SUM(IF(dp.nota=\"Nota de credito\",0,dp.Capital)) Capital,       \r\n      mp.totalpagado Importe,\r\n      co.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37\r\nFROM maestrodepago mp, detalledepago dp, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, consulta co\r\nWHERE mp.prestamo=pr.numero\r\n  AND mp.numero=dp.maestrodepago\r\n  AND pr.sucursal=su.numero\r\n  AND pr.cliente=cl.numero \r\n  AND pr.vendedor=ve.numero\r\n  AND cl.empleador=em.numero\r\n  AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END	\r\n  AND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\n  AND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE ve.nombre=co.filtro3 END\r\n  AND CASE co.filtro4 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro4 END\r\n  AND CASE co.filtro5 WHEN \'\' THEN 1=1 ELSE mp.tipodepago=co.filtro5 END\r\n  AND mp.fecha BETWEEN co.filtro36 AND co.filtro37 	\r\n  AND mp.estatus=\"ORIGINAL\" \r\n  AND (pr.estatus<>\"CANCELADO\")	\r\n  AND dp.prestamo=pr.numero\r\n  AND dp.nota NOT IN(\"Interes descontado\",\"Interes descontado por abono\")        \r\n  AND co.reporte=\'ingresos x cliente\'\r\n GROUP BY dp.maestrodepago\r\nORDER BY cl.nombre;\r\n\r\n\r\n\r\n\r\n\r\nCREATE TABLE subtotal\r\nSELECT cliente,SUM(comision) scomision, SUM(notacredito) snotacredito, SUM(gastoslegales) sgastoslegales, \r\n  SUM(mora) smora, SUM(interes) sinteres, SUM(capital) scapital, SUM(importe) simporte\r\nFROM detalle\r\nGROUP BY cliente;\r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(scomision) tcomision, SUM(snotacredito) tnotacredito, SUM(sgastoslegales) tgastoslegales, \r\nSUM(smora) tmora, SUM(sinteres) tinteres, SUM(scapital) tcapital, SUM(simporte) timporte\r\nFROM subtotal;\r\n\r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(empleador)) cempleador, COUNT(DISTINCT(vendedor)) cvendedor,\r\nCOUNT(DISTINCT(prestamo)) cprestamo,   COUNT(DISTINCT(cliente))  ccliente\r\nFROM detalle;\r\n\r\n\r\nSELECT * FROM detalle d, subtotal s, total t, cantidad c\r\nWHERE d.cliente=s.cliente\r\nORDER BY d.cliente,d.fecha;\r\n\r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\n\r\n\r\n\r\nEND','PRESTAMOS SANCHITO','','','','','2015-01-30','mm/dd/yyyy','f:f','11','10','9','8','7','3','CLIENTE_1,SCOMISION,SNOTACREDITO,SGASTOSLEGALES,SMORA,SINTERES,SCAPITAL,SIMPORTE,TCOMISION,TNOTACREDITO,TMORA,TINTERES,TCAPITAL,TIMPORTE,CEMPLEADOR,CVENDEDOR,CPRESTAMO,CCLIENTE,tgastoslegales,filtro1,filtro2,filtro3,filtro4,filtro5,filtro36,filtro37,','g:n','#,##0.00',NULL,NULL,NULL,NULL,'12','13','14','14','14','14','14','14','14',NULL,'','','','','','2019-05-05','2019-05-05','2000-01-01','2000-01-01','2000-01-01',0,''),('INGRESOS X FECHA','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\n-- este detalle incluye las notas de credito\r\nCREATE TABLE detalle  \r\nSELECT -- esto es para la tabla cantidad\r\n      em.Nombre empleador, ve.nombre vendedor,\r\n      cl.nombre Cliente,     \r\n      pr.numero Prestamo, mp.numero Recibo,  mp.fecha Fecha, mp.comision Comision,       \r\n      mp.notadecredito Notacredito, \r\n       SUM(IF(dp.nota=\"Nota de credito\",0,(pr.gastolegales/pr.montototal) * dp.capital)) Gastoslegales, \r\n      mp.mora Mora, \r\n                                                      \r\n      -- el interes y el capital tienen la nota de credito incluida. por lo que estos dos campos no son muy confiables\r\n      dp.nota,\r\n      SUM(IF(dp.nota=\"Nota de credito\",0,dp.interes)) Interes, \r\n      SUM(IF(dp.nota=\"Nota de credito\",0,dp.Capital)) Capital,       \r\n      mp.totalpagado Importe,\r\n      co.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37\r\nFROM maestrodepago mp, detalledepago dp, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, consulta co\r\nWHERE mp.prestamo=pr.numero\r\n  AND mp.numero=dp.maestrodepago\r\n  AND pr.sucursal=su.numero\r\n  AND pr.cliente=cl.numero \r\n  AND pr.vendedor=ve.numero\r\n  AND cl.empleador=em.numero\r\n  AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END	\r\n  AND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\n  AND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE ve.nombre=co.filtro3 END\r\n  AND CASE co.filtro4 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro4 END\r\n  AND CASE co.filtro5 WHEN \'\' THEN 1=1 ELSE mp.tipodepago=co.filtro5 END\r\n  AND mp.fecha BETWEEN co.filtro36 AND co.filtro37 	\r\n  AND mp.estatus=\"ORIGINAL\" \r\n  AND (pr.estatus<>\"CANCELADO\")	\r\n  AND dp.prestamo=pr.numero\r\n  AND dp.nota NOT IN(\"Interes descontado\",\"Interes descontado por abono\")        \r\n  AND co.reporte=\'ingresos x fecha\'\r\n GROUP BY mp.numero\r\nORDER BY mp.fecha;\r\n\r\n\r\n\r\n\r\n\r\nCREATE TABLE subtotal\r\nSELECT fecha,SUM(comision) scomision, SUM(notacredito) snotacredito, SUM(gastoslegales) sgastoslegales, \r\n  SUM(mora) smora, SUM(interes) sinteres, SUM(capital) scapital, SUM(importe) simporte\r\nFROM detalle\r\nGROUP BY fecha;\r\n\r\n\r\nCREATE TABLE total\r\nSELECT SUM(scomision) tcomision, SUM(snotacredito) tnotacredito, SUM(sgastoslegales) tgastoslegales, \r\nSUM(smora) tmora, SUM(sinteres) tinteres, SUM(scapital) tcapital, SUM(simporte) timporte\r\nFROM subtotal;\r\n\r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(empleador)) cempleador, COUNT(DISTINCT(vendedor)) cvendedor,\r\nCOUNT(DISTINCT(prestamo)) cprestamo,   COUNT(DISTINCT(cliente))  ccliente\r\nFROM detalle;\r\n\r\n\r\nSELECT * FROM detalle d, subtotal s, total t, cantidad c\r\nWHERE d.fecha=s.fecha\r\ngroup by d.recibo\r\nORDER BY d.fecha,d.recibo;\r\n\r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;\r\nDROP TABLE cantidad;\r\n\r\n\r\n\r\nEND','PRESTAMOS SANCHITO','','','','','2015-01-30','mm/dd/yyyy','f:f','11','10','9','8','7','3','CLIENTE_1,SCOMISION,SNOTACREDITO,SGASTOSLEGALES,SMORA,SINTERES,SCAPITAL,SIMPORTE,TCOMISION,TNOTACREDITO,TMORA,TINTERES,TCAPITAL,TIMPORTE,CEMPLEADOR,CVENDEDOR,CPRESTAMO,CCLIENTE,tgastoslegales,filtro1,filtro2,filtro3,filtro4,filtro5,filtro36,filtro37,','g:n','#,##0.00',NULL,NULL,NULL,NULL,'12','13','14','14','14','14','14','14','14',NULL,'','','','','','2019-05-07','2019-05-08','2000-01-01','2000-01-01','2000-01-01',0,''),('COMENTARIO DE PRESTAMO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nselect p.numero prestamo, c.nombre cliente, p.comentario  \r\nfrom prestamo p, cliente c, consulta co\r\nwhere p.cliente=c.numero\r\nand p.estatus <> \'cancelado\'\r\nand p.fecha between co.filtro36 and co.filtro37\r\nand co.reporte=\'comentario de prestamo\'\r\norder by cliente;\r\n\r\n\r\nEND','','2012-07-01','2014-07-31','','','','','','','','','','','','','','',NULL,NULL,NULL,NULL,'','','','','','','','','',NULL,'','','','','','2014-07-01','2014-07-15','2000-01-01','2000-01-01','2000-01-01',0,''),('RESUMEN CUENTA X COBRAR','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle\r\n      SELECT em.nombre Empleador,\r\n	pr.numero Prestamo,\r\n	cl.nombre Cliente, \r\n	cu.numero NumeroCuota, cu.vencimiento Vencimiento, cu.interespendiente Interes, cu.capitalpendiente Capital, cu.cuota Cuota ,\r\n              cu.interespendiente+cu.capitalpendiente pendiente,\r\n	co.filtro1,co.filtro36,co.filtro37\r\n      FROM prestamo pr, cuota cu, cliente cl, empleador em, consulta co\r\n      WHERE pr.estatus IN(\"ORIGINAL\",\"ABONADO\") \r\n      AND pr.numero=cu.prestamo\r\n      AND pr.cliente=cl.numero \r\n      AND cl.empleador=em.numero       \r\n      AND cu.vencimiento BETWEEN co.filtro36 AND co.filtro37\r\n      AND (cu.interespendiente + cu.capitalpendiente > 0)\r\n      AND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE em.Nombre=co.FILTRO1 END \r\n      AND co.reporte=\'RESUMEN CUENTA X COBRAR\'\r\n      ORDER BY em.nombre, pr.Numero, cu.Numero ;\r\n      \r\nCREATE TABLE subtotal      \r\n      SELECT cliente, SUM(interes) sinteres, SUM(capital) scapital, SUM(cuota) scuota, SUM(pendiente) spendiente,\r\n      count(distinct(cliente)) scliente,  count(distinct(prestamo)) sprestamo, count(NUMEROCUOTA) sNUMEROCUOTA\r\n      FROM detalle \r\n      GROUP BY cliente;\r\n      \r\nCREATE TABLE total      \r\n      SELECT SUM(sinteres) tinteres, SUM(scapital) tcapital, SUM(scuota) tcuota, SUM(spendiente) tpendiente\r\n      FROM subtotal;\r\n      \r\nCREATE TABLE cantidad\r\nSELECT COUNT(DISTINCT(prestamo)) cprestamo, COUNT(DISTINCT(empleador)) cempleador, COUNT(DISTINCT(cliente)) ccliente\r\nFROM detalle;         \r\n      \r\n      SELECT * FROM detalle d, subtotal s, total t, cantidad c\r\n      WHERE d.cliente=s.cliente\r\n      order by d.empleador,d.cliente,d.prestamo;\r\n      \r\nDROP TABLE detalle;\r\nDROP TABLE subtotal;\r\nDROP TABLE total;      \r\nDROP TABLE cantidad;\r\n       \r\n\r\nEND','','2014-01-01','2014-12-31','','','','mm/dd/yyyy','e:e','8','8','8','7','6','1','empleador_1,sinteres,scapital,scuota,sNUMEROCUOTA,tinteres,tcapital,tcuota,filtro1,filtro36,filtro37,cprestamo,cempleador,ccliente,scliente,sprestamo,spendiente,','f:h','#,##0.00',NULL,NULL,NULL,NULL,'8','8','8','8','8','8','8','8','8',NULL,'','','','','','2012-07-25','2017-12-24','2000-01-01','2000-01-01','2000-01-01',0,''),('INVENTARIO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle  \r\nSELECT pr.Numero prestamo, pr.fecha, pr.Vendedor vend, pr.cliente clie, ve.nombre Vendedor, cl.nombre Cliente, \r\n-- deuda\r\npr.gastolegales gasto, SUM(cu.mora) mora, SUM(cu.interes) interes, SUM(cu.interespendiente) interesp,\r\nSUM(cu.capital) capital, SUM(cu.capitalpendiente) capitalp, SUM(cu.mora+cu.interes+capital) deuda,\r\n-- pagado\r\n(SELECT SUM(totalpagado) FROM maestrodepago WHERE prestamo=cu.prestamo) pagado,\r\n-- saldo  \r\nSUM(cu.mora+cu.interespendiente+cu.capitalpendiente) saldo,\r\n-- parametros\r\nco.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37,co.filtro31\r\n\r\nFROM cuota cu, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, usuario u, consulta co\r\nWHERE cu.prestamo=pr.Numero\r\n AND pr.sucursal=su.numero	\r\n AND (pr.vendedor=ve.numero)\r\n AND (pr.cliente=cl.numero) \r\n AND cl.empleador=em.numero\r\n and pr.usuario=u.numero\r\n	\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\nAND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE  ve.nombre=co.filtro3 END\r\nAND CASE co.filtro5 WHEN \'\' THEN 1=1 ELSE u.nombre=co.filtro5 END\r\nAND CASE co.filtro4 WHEN \'\' THEN pr.estatus IN(\"Original\",\"Abonado\",\"Saldado\") \r\n                    WHEN \'Original y Abonado\' THEN pr.estatus IN(\"Original\",\"Abonado\") \r\n                    WHEN \'Legal\' THEN pr.estatus2 IN(\"Legal\") \r\n                    WHEN \'Castigado\' THEN pr.estatus2 IN(\"Castigado\") \r\n                    ELSE pr.estatus IN(co.filtro4) END\r\nAND CASE when co.filtro4 not in(\"legal\",\"castigado\") THEN pr.estatus2 not in(\"legal\",\"castigado\") END\r\nAND pr.fecha BETWEEN co.filtro36 AND co.filtro37\r\nAND CASE co.filtro31 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro31 END	\r\nAND co.reporte=\'inventario\'\r\nGROUP BY cu.prestamo;\r\n\r\n\r\n\r\n\r\n CREATE TABLE subtotal\r\n SELECT vend, SUM(gasto) sgasto, SUM(mora) smora, SUM(interes) sinteres, SUM(interesp) sinteresp, SUM(capital) scapital, SUM(capitalp) scapitalp, \r\n SUM(deuda) sdeuda, SUM(pagado) spagado, SUM(saldo) ssaldo, count(distinct(cliente)) scliente, count(distinct(prestamo)) sprestamo    \r\n FROM detalle\r\n GROUP BY vendedor ;\r\n   \r\n      \r\n CREATE TABLE total\r\n SELECT SUM(sgasto) tgasto, SUM(smora) tmora, SUM(sinteres) tinteres, SUM(sinteresp) tinteresp, SUM(scapital) tcapital, SUM(scapitalp) tcapitalp, \r\n SUM(sdeuda) tdeuda, SUM(spagado) tpagado, SUM(ssaldo) tsaldo   \r\n FROM subtotal;\r\n       \r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(prestamo) cprestamo, COUNT(DISTINCT(vend)) cvendedor, COUNT(DISTINCT(clie)) ccliente\r\nFROM detalle;      \r\n\r\nSELECT * FROM detalle d,subtotal s,total t,cantidad c\r\nWHERE d.vend=s.vend\r\norder by d.vend, d.fecha;\r\n\r\nDROP TABLE IF EXISTS detalle;\r\nDROP TABLE IF EXISTS subtotal;\r\nDROP TABLE IF EXISTS total;\r\nDROP TABLE IF EXISTS cantidad;\r\n\r\nEND','EMPRESA DE PR','','','','','','mm/dd/yyyy','b:b','11','10','9','8','7','5','vend,clie,filtro1,filtro2,filtro3,filtro4,filtro5,filtro36,filtro37,filtro31,vend_1,sgasto,smora,sinteres,sinteresp,scapital,scapitalp,sdeuda,spagado,ssaldo,tgasto,tmora,tinteres,tinteresp,tcapital,tcapitalp,tdeuda,tpagado,tsaldo,cprestamo,cvendedor,ccliente,scliente,sprestamo,','g:o','#,##0.00',NULL,NULL,NULL,NULL,'12','13','14','15','15','15','15','15','15',NULL,'','','','','','2019-01-16','2019-02-17','2000-01-01','2000-01-01','2000-01-01',0,''),('INVENTARIO','call procedimiento()','CREATE PROCEDURE procedimiento()\r\nBEGIN\r\n\r\nCREATE TABLE detalle  \r\nSELECT pr.Numero prestamo, pr.fecha, pr.Vendedor vend, pr.cliente clie, ve.nombre Vendedor, cl.nombre Cliente, \r\n-- deuda\r\npr.gastolegales gasto, SUM(cu.mora) mora, SUM(cu.interes) interes, SUM(cu.interespendiente) interesp,\r\nSUM(cu.capital) capital, SUM(cu.capitalpendiente) capitalp, SUM(cu.mora+cu.interes+capital) deuda,\r\n-- pagado\r\n(SELECT SUM(totalpagado) FROM maestrodepago WHERE prestamo=cu.prestamo) pagado,\r\n-- saldo  \r\nSUM(cu.mora+cu.interespendiente+cu.capitalpendiente) saldo,\r\n-- parametros\r\nco.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37,co.filtro31\r\n\r\nFROM cuota cu, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, usuario u, consulta co\r\nWHERE cu.prestamo=pr.Numero\r\n AND pr.sucursal=su.numero	\r\n AND (pr.vendedor=ve.numero)\r\n AND (pr.cliente=cl.numero) \r\n AND cl.empleador=em.numero\r\n and pr.usuario=u.numero\r\n	\r\nAND CASE co.filtro1 WHEN \'\' THEN 1=1 ELSE su.nombre=co.filtro1 END\r\nAND CASE co.filtro2 WHEN \'\' THEN 1=1 ELSE em.nombre=co.filtro2 END\r\nAND CASE co.filtro3 WHEN \'\' THEN 1=1 ELSE  ve.nombre=co.filtro3 END\r\nAND CASE co.filtro5 WHEN \'\' THEN 1=1 ELSE u.nombre=co.filtro5 END\r\nAND CASE co.filtro4 WHEN \'\' THEN pr.estatus IN(\"Original\",\"Abonado\",\"Saldado\") \r\n                    WHEN \'Original y Abonado\' THEN pr.estatus IN(\"Original\",\"Abonado\") \r\n                    WHEN \'Legal\' THEN pr.estatus2 IN(\"Legal\") \r\n                    WHEN \'Castigado\' THEN pr.estatus2 IN(\"Castigado\") \r\n                    ELSE pr.estatus IN(co.filtro4) END\r\nAND CASE when co.filtro4 not in(\"legal\",\"castigado\") THEN pr.estatus2 not in(\"legal\",\"castigado\") END\r\nAND pr.fecha BETWEEN co.filtro36 AND co.filtro37\r\nAND CASE co.filtro31 WHEN \'\' THEN 1=1 ELSE cl.nombre=co.filtro31 END	\r\nAND co.reporte=\'inventario\'\r\nGROUP BY cu.prestamo;\r\n\r\n\r\n\r\n\r\n CREATE TABLE subtotal\r\n SELECT vend, SUM(gasto) sgasto, SUM(mora) smora, SUM(interes) sinteres, SUM(interesp) sinteresp, SUM(capital) scapital, SUM(capitalp) scapitalp, \r\n SUM(deuda) sdeuda, SUM(pagado) spagado, SUM(saldo) ssaldo, count(distinct(cliente)) scliente, count(distinct(prestamo)) sprestamo    \r\n FROM detalle\r\n GROUP BY vendedor ;\r\n   \r\n      \r\n CREATE TABLE total\r\n SELECT SUM(sgasto) tgasto, SUM(smora) tmora, SUM(sinteres) tinteres, SUM(sinteresp) tinteresp, SUM(scapital) tcapital, SUM(scapitalp) tcapitalp, \r\n SUM(sdeuda) tdeuda, SUM(spagado) tpagado, SUM(ssaldo) tsaldo   \r\n FROM subtotal;\r\n       \r\n\r\nCREATE TABLE cantidad\r\nSELECT COUNT(prestamo) cprestamo, COUNT(DISTINCT(vend)) cvendedor, COUNT(DISTINCT(clie)) ccliente\r\nFROM detalle;      \r\n\r\nSELECT * FROM detalle d,subtotal s,total t,cantidad c\r\nWHERE d.vend=s.vend\r\norder by d.vend, d.fecha;\r\n\r\nDROP TABLE IF EXISTS detalle;\r\nDROP TABLE IF EXISTS subtotal;\r\nDROP TABLE IF EXISTS total;\r\nDROP TABLE IF EXISTS cantidad;\r\n\r\nEND','EMPRESA DE PR','','','','','','mm/dd/yyyy','b:b','11','10','9','8','7','5','vend,clie,filtro1,filtro2,filtro3,filtro4,filtro5,filtro36,filtro37,filtro31,vend_1,sgasto,smora,sinteres,sinteresp,scapital,scapitalp,sdeuda,spagado,ssaldo,tgasto,tmora,tinteres,tinteresp,tcapital,tcapitalp,tdeuda,tpagado,tsaldo,cprestamo,cvendedor,ccliente,scliente,sprestamo,','g:o','#,##0.00',NULL,NULL,NULL,NULL,'12','13','14','15','15','15','15','15','15',NULL,'','','','','','2019-01-16','2019-02-17','2000-01-01','2000-01-01','2000-01-01',0,'');

