/*Table structure for table `cuotaagregada` */

DROP TABLE IF EXISTS `cuotaagregada`;

CREATE TABLE `cuotaagregada` (
  `numero` int(11) NOT NULL auto_increment,
  `usuario` varchar(100) default '',
  `prestamo` int(11) NOT NULL default '0',
  `monto` double(12,2) NOT NULL default '0.00',
  `vencimiento` date NOT NULL default '2000-01-01',
  `fecha` date NOT NULL default '2000-01-01',
  `hora` time NOT NULL default '00:00:00',
  `sucursal` varchar(100) NOT NULL default '',
  PRIMARY KEY  (`numero`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `cuotaagregada` */

/*Table structure for table `cuotac` */

DROP TABLE IF EXISTS `cuotac`;

CREATE TABLE `cuotac` (
  `Registro` int(10) unsigned NOT NULL default '0',
  `Prestamo` int(10) unsigned NOT NULL default '0',
  `Numero` int(10) unsigned NOT NULL default '0',
  `Vencimiento` date default NULL,
  `Mora` double(12,2) NOT NULL default '0.00',
  `Interes` double(12,2) NOT NULL default '0.00',
  `InteresPagado` double(12,2) NOT NULL default '0.00',
  `InteresPendiente` double(12,2) NOT NULL default '0.00',
  `Capital` double(12,2) NOT NULL default '0.00',
  `CapitalPagado` double(12,2) NOT NULL default '0.00',
  `CapitalPendiente` double(12,2) NOT NULL default '0.00',
  `Cuota` double(12,2) NOT NULL default '0.00',
  `DiasVencido` int(10) unsigned NOT NULL default '0',
  `DiasPago` int(11) NOT NULL default '0',
  `Estatus` varchar(10) NOT NULL default 'ORIGINAL',
  `Usuariox` int(5) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `cuotac` */

