/*Table structure for table `maestrodepagoc` */

DROP TABLE IF EXISTS `maestrodepagoc`;

CREATE TABLE `maestrodepagoc` (
  `Numero` int(10) unsigned NOT NULL default '0',
  `Prestamo` int(10) unsigned NOT NULL default '0',
  `Efectivo` double(12,2) NOT NULL default '0.00',
  `Cheque` double(12,2) NOT NULL default '0.00',
  `Tarjeta` double(12,2) NOT NULL default '0.00',
  `Mora` double(12,2) NOT NULL default '0.00',
  `DescuentoInteres` double(12,2) NOT NULL default '0.00',
  `TipoDePago` varchar(45) NOT NULL default 'PAGO NORMAL',
  `NotaDeCredito` double(12,2) NOT NULL default '0.00',
  `Nota` varchar(250) NOT NULL default 'SIN NOTA',
  `Comision` double(12,2) NOT NULL default '0.00',
  `Fecha` date default NULL,
  `Estatus` varchar(10) NOT NULL default 'ORIGINAL',
  `TotalPagado` double(12,2) NOT NULL default '0.00',
  `Usuario` int(10) unsigned NOT NULL default '0',
  `Sucursal` int(10) unsigned NOT NULL default '0',
  `TotalARebajar` double(12,2) NOT NULL default '0.00',
  `InteresPendiente` double(12,2) NOT NULL default '0.00' COMMENT 'ya que mostraba el pendiente actual y no es correcto eso.',
  `CapitalPendiente` double(12,2) NOT NULL default '0.00',
  `TotalPendiente` double(12,2) NOT NULL default '0.00',
  `Capital` double(12,2) NOT NULL default '0.00',
  `cancelado` double(12,2) NOT NULL default '0.00',
  `usuariocancela` varchar(50) NOT NULL default '',
  `fechacancela` date default NULL,
  `FechaHoy` date default NULL,
  `Hora` time default NULL,
  `Usuariox` int(5) default NULL,
  `INICIAL` decimal(12,2) NOT NULL default '0.00',
  KEY `Numero` (`Numero`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `maestrodepagoc` */

