/*Table structure for table `prestamoc` */

DROP TABLE IF EXISTS `prestamoc`;

CREATE TABLE `prestamoc` (
  `Numero` int(10) unsigned NOT NULL default '0',
  `Monto` double(12,2) NOT NULL default '0.00',
  `TasaInteres` double(12,8) NOT NULL default '0.00000000',
  `TasaMora` double(12,8) NOT NULL default '0.00000000',
  `TasaGastoLegales` double(12,2) NOT NULL default '0.00',
  `Sepaga` varchar(15) NOT NULL default 'MENSUAL',
  `Plazo` int(10) unsigned NOT NULL default '0',
  `Vendedor` int(10) unsigned NOT NULL default '0',
  `Cliente` int(10) unsigned NOT NULL default '0',
  `MontoTotal` double(12,2) NOT NULL default '0.00',
  `GastoLegales` double(12,2) NOT NULL default '0.00',
  `Metodo` varchar(20) NOT NULL default 'FRANCES',
  `Estatus` varchar(20) NOT NULL default 'ORIGINAL',
  `Fecha` date default NULL,
  `Comentario` varchar(200) NOT NULL default 'SIN COMENTARIO',
  `Sucursal` int(10) unsigned NOT NULL default '0',
  `EnDataCredito` tinyint(1) NOT NULL default '0',
  `EstatusDC` varchar(20) NOT NULL default 'NINGUNO',
  `TipoPrestamo` varchar(20) default NULL,
  `Estatus2` varchar(20) NOT NULL default '-',
  `Creado` date default NULL,
  `Inicial` double(12,2) NOT NULL default '0.00',
  `Usuario` int(10) unsigned NOT NULL default '0',
  `Usuariox` int(5) default NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `prestamoc` */

/*Table structure for table `prestamosenuso` */

