/* Trigger structure for table `maestrodepagoc` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `MaestrodepagocBeforeUpdate` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `MaestrodepagocBeforeUpdate` BEFORE UPDATE ON `maestrodepagoc` FOR EACH ROW BEGIN  
         
         DECLARE vme,vse VARCHAR(40);
         DECLARE vti,vca DECIMAL(12,2);	
	
	IF new.estatus='CANCELADO' THEN
	IF new.totalpagado > 0 THEN 
	SET new.cancelado=new.totalpagado;
	END IF; -- paso el total a este campo para mostrar el monto cancelado
	
	SET new.efectivo=0;
	SET new.cheque=0;
	SET new.tarjeta=0;
	SET new.notadecredito=0;
	SET new.capital=0;
	SET new.comision=0;
	SET new.inicial=0;
	SET new.mora=0;
	SET new.descuentointeres=0;
	SET new.totalpagado=0;
	SET new.totalarebajar=0;
	SET new.fechacancela=date(now());
	     
        
         	
	DELETE FROM detalledepagoc WHERE maestrodepago=new.numero;	
	DELETE FROM detalledepago WHERE maestrodepago=new.numero;
	
	CALL Cuota_Procesos(new.usuariox);
	
	/* 
        --quitar esto de comentario para que el interes se recalcule en el metodo americano
         	
	-- recalculo el interes de cada cuota donde el interespagado=0
		SELECT metodo,sepaga,tasainteres INTO vme,vse,vti FROM prestamoc where usuariox=new.usuariox;
		SELECT capitalpendiente INTO vca FROM cuotac where usuariox=new.usuariox ORDER BY numero DESC LIMIT 1;         	
		IF vme='AMERICANO' THEN	 
			UPDATE cuotac SET interes=ftasa(vse,vti) * vca WHERE interespagado=0 and usuariox=new.usuariox;
		END IF;	
		
	
	CALL Cuota_Procesos(new.usuariox);
	*/		
	END IF;
END */$$


DELIMITER ;

/* Trigger structure for table `prestamo` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `PrestamoAfterInsert` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `PrestamoAfterInsert` AFTER INSERT ON `prestamo` FOR EACH ROW BEGIN 
        CALL creacuotas(new.Plazo,new.tasainteres,new.montototal, new.fechainicio,new.sepaga, new.numero, new.metodo,'PERMANENTE');
        
	if new.diasfijos='si' then	
	     if new.sepaga='QUINCENAL' then
	          call set_15_y_30(new.numero);
             elseif new.sepaga='MENSUAL' THEN          	 
             	  CALL set_dia_igual( new.numero, day(new.fechainicio) );   
	     end if;
	     
	end if;	
END */$$


DELIMITER ;

/* Trigger structure for table `prestamo` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `PrestamoAfterUpdate` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `PrestamoAfterUpdate` BEFORE UPDATE ON `prestamo` FOR EACH ROW BEGIN  
	IF new.actualizaprestamo='si' THEN
	IF new.diasfijos='si' THEN	
	     IF new.sepaga='QUINCENAL' THEN
	          CALL set_15_y_30(new.numero);
             ELSEIF new.sepaga='MENSUAL' THEN
             	  CALL set_dia_igual( new.numero, DAY(new.fechainicio) );   
	     END IF;
	     
	END IF;	
	END IF;	
END */$$


DELIMITER ;

/* Trigger structure for table `prestamotemporal` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `PrestamotemporalBeforeInsert` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `PrestamotemporalBeforeInsert` BEFORE INSERT ON `prestamotemporal` FOR EACH ROW begin 
set @gastolegales=(new.monto*(new.tasagastolegales/100) ) ;
set new.gastolegales=@gastolegales;
set new.montototal=new.monto+@gastolegales;
end */$$


DELIMITER ;

/* Trigger structure for table `prestamotemporal` */

