/* Function  structure for function  `AjustaFecha` */

/*!50003 DROP FUNCTION IF EXISTS `AjustaFecha` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `AjustaFecha`(
diasfijos VARCHAR(2),
pfechaprestamo VARCHAR(10),
psepaga VARCHAR(15)
) RETURNS varchar(10) CHARSET utf8
BEGIN
		IF (diasfijos)='si' THEN
			IF (MONTH(pfechaprestamo)=1) AND (psepaga='MENSUAL') AND (DAY(pfechaprestamo)>29) THEN 
                               SET pfechaprestamo=CONCAT(YEAR(pfechaprestamo),'-02-28');
                        ELSEIF MONTH(pfechaprestamo) =2 AND (psepaga='QUINCENAL') THEN 
					IF DAY(pfechaprestamo) < 15 THEN 
						SET pfechaprestamo= sumadiasafecha(pfechaprestamo,sepaga(psepaga)-2);
					ELSE
						SET pfechaprestamo=sumadiasafecha(pfechaprestamo,sepaga(psepaga));
					END IF;
			ELSE 
		             SET pfechaprestamo=sumadiasafecha(pfechaprestamo,sepaga(psepaga));
			END IF;
		ELSE
			SET pfechaprestamo=sumadiasafecha(pfechaprestamo,sepaga(psepaga));
                END IF; 
    		         
    		      
    		      
			    
		IF DAY(pfechaprestamo)=31 THEN
			SET pfechaprestamo=sumadiasafecha(pfechaprestamo,1);
		END IF;
		
		RETURN pfechaprestamo;
	
END */$$
DELIMITER ;

