/* Function  structure for function  `DiasConCuota` */

/*!50003 DROP FUNCTION IF EXISTS `DiasConCuota` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `DiasConCuota`(
Pfechavencimiento VARCHAR(10),
PfechaPago VARCHAR(10),
Psepaga VARCHAR(15)
) RETURNS int(11)
BEGIN
        	DECLARE vDiasConCuota INTEGER;
	DECLARE  vfechainicio VARCHAR(10);
	
	SET vfechainicio=RestaDiasAFecha(pfechavencimiento,sepaga(psepaga));		
	SET vDiasConCuota = DATEDIFF(Pfechapago,vfechainicio);	
	IF vDiasConCuota>0 THEN	
		IF  (vDiasConCuota > sepaga(psepaga)) THEN 
		SET vDiasConCuota=sepaga(psepaga);
		END IF;
	ELSEIF vDiasConCuota<=0 THEN
		SET vDiasConCuota=0;
	END IF;
	
	RETURN vDiasConCuota;
            
END */$$
DELIMITER ;

