DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `DIASVENCIDOS`(
Pfechapago DATE,
Pfechavencimiento DATE
) RETURNS int(11)
BEGIN
        DECLARE vDiasVencidos INTEGER;	
	SET vDiasVencidos= DATEDIFF(pfechapago,pfechavencimiento);	
	IF vDiasVencidos < 0 THEN
		SET vDiasVencidos = 0;
	END IF;
	
	RETURN VDiasVencidos;
            
END */$$
