/* Function  structure for function  `FTasa` */

/*!50003 DROP FUNCTION IF EXISTS `FTasa` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `FTasa`(
	pSePaga VARCHAR(15),		
	ptasa  DECIMAL(12,2)
) RETURNS double(12,6)
BEGIN 
	DECLARE vresultado DOUBLE(12,6) DEFAULT 0.00;
	IF PSEPAGA	='ANUAL' 		THEN SET vresultado=(PTASA*12)/100;
	ELSEIF PSEPAGA	='SEMESTRAL' 	THEN SET vresultado=(PTASA*6)/100;	 	
	ELSEIF PSEPAGA	='CUATRIMESTRAL' THEN SET  vresultado=(PTASA*4)/100;
	ELSEIF PSEPAGA	='TRIMESTRAL' 	THEN SET vresultado=(PTASA*3)/100;
	ELSEIF PSEPAGA	='MENSUAL' 	THEN SET vresultado=PTASA/100;	 
	ELSEIF PSEPAGA	='QUINCENAL' 	THEN SET vresultado=(PTASA/2)/100;	
	ELSEIF PSEPAGA	='SEMANAL'	THEN SET vresultado=(PTASA/4)/100;	
	ELSEIF PSEPAGA	='DIARIO' 		THEN SET vresultado=(PTASA/30)/100;
	END IF;	
	RETURN Vresultado;
END */$$
DELIMITER ;

/* Function  structure for function  `Ganancia` */

/*!50003 DROP FUNCTION IF EXISTS `Ganancia` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `Ganancia`(
	pcliente INT,
	pSePaga VARCHAR(15)		
) RETURNS double(12,6)
BEGIN 
	DECLARE vresultado DOUBLE(12,6) DEFAULT 0.00;
	
	SET vresultado=(
	(((SELECT ingreso FROM cliente WHERE numero=pcliente) / 30)  * sepaga(psepaga))
	-(((SELECT egreso FROM cliente WHERE numero=pcliente) / 30)  * sepaga(psepaga))
	);
	RETURN Vresultado;
END */$$
