/* Function  structure for function  `RestaDiasAFecha` */

/*!50003 DROP FUNCTION IF EXISTS `RestaDiasAFecha` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `RestaDiasAFecha`(
	pfecha VARCHAR(40),
	pdias  INTEGER	
) RETURNS varchar(10) CHARSET utf8
BEGIN
        	DECLARE vresultado VARCHAR(10);
	SET vresultado= DATE_SUB(pfecha, INTERVAL pdias DAY);	
	RETURN vresultado;
END */$$
DELIMITER ;

/* Function  structure for function  `SePaga` */

/*!50003 DROP FUNCTION IF EXISTS `SePaga` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `SePaga`(
	pSePaga VARCHAR(15)		
) RETURNS double(12,6)
BEGIN 
	DECLARE vresultado DOUBLE(12,6) DEFAULT 0.00;
	IF pSePaga	='ANUAL' 	THEN SET vresultado=360;
	ELSEIF pSePaga	='SEMESTRAL'	THEN SET vresultado=180;
 	ELSEIF pSePaga	='CUATRIMESTRAL'THEN SET vresultado=120; 
	ELSEIF pSePaga	='TRIMESTRAL'	THEN SET vresultado=90;
	ELSEIF pSePaga	='MENSUAL'	THEN SET vresultado=30;
 	ELSEIF pSePaga	='QUINCENAL' 	THEN SET vresultado=15; 
 	ELSEIF pSePaga	='BISEMANAL' 	THEN SET vresultado=14;
 	ELSEIF pSePaga	='SEMANAL' 	THEN SET vresultado=7; 
 	ELSEIF pSePaga	='DIARIO' 	THEN SET vresultado=1; 	
	END IF;
	RETURN Vresultado;
END */$$
DELIMITER ;

/* Function  structure for function  `SumaDiasAFecha` */

/*!50003 DROP FUNCTION IF EXISTS `SumaDiasAFecha` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `SumaDiasAFecha`(
	pfecha VARCHAR(40),
	pdias  INTEGER
	
) RETURNS varchar(10) CHARSET utf8
BEGIN
        	DECLARE vresultado VARCHAR(10);
	SET vresultado= DATE_ADD(pfecha, INTERVAL pdias DAY);	
	RETURN vresultado;
END */$$
DELIMITER ;

