/* Procedure structure for procedure `ActualizarDatos` */

/*!50003 DROP PROCEDURE IF EXISTS  `ActualizarDatos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `ActualizarDatos`(
pusuario INT
)
BEGIN
                                  
UPDATE cuota a, cuotac b
SET  a.Mora = b.Mora, a.Interes = b.Interes, a.InteresPagado = b.InteresPagado, a.InteresPendiente = b.InteresPendiente, 
a.Capital = b.Capital, a.CapitalPagado = b.CapitalPagado, a.CapitalPendiente = b.CapitalPendiente, a.Cuota = b.Cuota, 
a.DiasVencido = b.DiasVencido, a.DiasPago = b.DiasPago, a.Estatus = b.Estatus, a.vencimiento=b.vencimiento
WHERE a.Registro = b.Registro AND usuariox=pusuario;
	
UPDATE prestamo a, prestamoc b SET a.Estatus=b.Estatus, 
                                   a.Estatusdc=b.Estatusdc,
                                   a.Estatus2=b.Estatus2
WHERE a.numero=b.numero AND usuariox=pusuario;	
	
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `AjustaComisionEnDetalle` */

/*!50003 DROP PROCEDURE IF EXISTS  `AjustaComisionEnDetalle` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AjustaComisionEnDetalle`(
)
BEGIN
	DECLARE pp INT;	-- PRIMER registro
	DECLARE up INT;  -- ULTIMO registro
	                         
        DROP TABLE IF EXISTS _comision;	
        
	CREATE TABLE _comision
	(
	id INT AUTO_INCREMENT NOT NULL PRIMARY KEY,
	prestamo INT,
	recibo INT	
	);	
	
     	     
	INSERT INTO _comision(prestamo,recibo)
	 SELECT prestamo,numero FROM maestrodepago WHERE comision=totalpagado AND comision >0 AND estatus<>'cancelado';
	
		SELECT MIN(id),MAX(id)   INTO pp,up  FROM _comision ;
		WHILE pp <= up DO
                         SET @detalle=(SELECT AUTO_INCREMENT FROM information_schema.TABLES 
                         WHERE table_name='detalledepago' AND table_schema="prestamos2");
	                         
                         INSERT INTO detalledepago(numero,prestamo,MaestroDePago,nota)
                              SELECT @detalle,prestamo,Recibo, 'Comision' FROM _comision WHERE id=pp;			
			
			SET pp=pp + 1;
		END WHILE;
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `Calculadora_TablaAmortizacion` */

/*!50003 DROP PROCEDURE IF EXISTS  `Calculadora_TablaAmortizacion` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Calculadora_TablaAmortizacion`(
 pprestamo INT
)
BEGIN
      DROP TABLE IF EXISTS TablaAmortizacion;      
      CREATE TABLE TablaAmortizacion
      SELECT p.numero pnumero, p.monto pcapital, p.tasainteres ptasainteres, p.tasagastolegales ptasagastolegales, 
      p.sepaga psepaga, p.plazo pplazo, p.metodo pmetodo, p.montototal ptotalcapital, 
      (SELECT SUM(interes) FROM cuotatemporal WHERE prestamo=pprestamo) pinteres, 
      p.gastolegales pGastoLegales, 
      (SELECT SUM(interes+capital) FROM cuotatemporal WHERE prestamo=pprestamo) pTotalsaldo,
      c.numero cnumero, c.vencimiento cvencimiento, c.interes cinteres, c.capital ccapital, c.cuota ccuota,
      0000000000.00 cinteresacumulado, 00000000000.00 ctotalsaldo, 00000000000.00 ctotalcapital
      FROM prestamotemporal p, cuotatemporal c
      WHERE  p.numero=c.prestamo AND p.numero=pprestamo
      ORDER BY c.numero;
      
      
      
      
      SET @FIN=(SELECT  MAX(CNUMERO) FROM TablaAmortizacion WHERE PNUMERO=PPRESTAMO);
      SET @INICIO=1;
      WHILE @INICIO<=@FIN DO
	IF @INICIO=1 THEN      
		UPDATE TablaAmortizacion SET cinteresacumulado=CINTERES, 
		CtotalSaldo=pTotalsaldo-ccuota, ctotalcapital=ptotalcapital-ccapital
		WHERE PNUMERO=PPRESTAMO AND CNUMERO=1;
	ELSE
		SELECT SUM(CINTERES),pTotalsaldo-SUM(ccuota),ptotalcapital-SUM(ccapital) INTO @IAcumulado,@tsaldo,@tcapital FROM TablaAmortizacion WHERE PNUMERO=PPRESTAMO AND CNUMERO<=@INICIO;
		
		UPDATE TablaAmortizacion SET cinteresacumulado= @IAcumulado,
		ctotalsaldo=@tsaldo, ctotalcapital=@tcapital
		WHERE PNUMERO=PPRESTAMO AND CNUMERO=@INICIO;
	END IF;
	SET @INICIO=@INICIO+1;	
      END WHILE;
      
      SELECT * FROM TablaAmortizacion;
      
END */$$
DELIMITER ;

/* Procedure structure for procedure `CalculaMora` */

/*!50003 DROP PROCEDURE IF EXISTS  `CalculaMora` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CalculaMora`(
pfechapago DATE,
pusuario INT
)
SALIR:BEGIN
       
	-- esto hay que ejuctarlo antes por obligacion 
	-- ya que si el prest. esta saldado y se cancelar el recibo, la sentnec. que le sigue
	-- a esta lo detectara como saldado                   
          CALL Cuota_Procesos(pusuario);           
          CALL Prestamo_Procesos(pusuario);          
                   
        -- si el prestamo esta saldado quito la mora vieja.
         UPDATE  cuotac SET mora=0 WHERE  usuariox=pusuario;         
    
	-- BUSCO EL ESTATUS DEL PRESTAMO
	-- SI ESTA SALDADO O CANCELADO SALIR DEL PROC.
	  IF (SELECT estatus FROM prestamoc WHERE   usuariox=pusuario) IN('SALDADO','CANCELADO') THEN
	  LEAVE SALIR;
	  END IF;
	-- si el prestamo esta en legal o castigado salir.
	  IF (SELECT estatus2 FROM prestamoc WHERE   usuariox=pusuario) IN('CASTIGADO') THEN  
	  LEAVE SALIR;
	  END IF;	
	 											
        -- actualizo los diaspago en cuota
        UPDATE cuotac c SET c.diaspago=IFNULL((SELECT SUM(diaspago) FROM detalledepagoc WHERE cuota=c.numero AND  diaspago>0   AND usuariox=pusuario ORDER BY cuota),0)
        WHERE   usuariox=pusuario;
             
        
	-- CALCULO LOS DIAS VENCIDOS DE CADA CUOTA. DEL PREST. INDICADO, DONDE ESTA NO ESTE SALDAD.
	-- y a estos les resto los diaspago	        	
	 UPDATE cuotac SET diasvencido= (DIASVENCIDOS(pfechapago,vencimiento))- (diaspago) WHERE estatus <>'SALDADA'   AND usuariox=pusuario;		
	-- SI LA CUOTA ESTA SALDADA PONGO LOS DIAS VENCIDOS A CERO
	 UPDATE cuotac SET diasvencido=0 WHERE estatus ='SALDADA'   AND usuariox=pusuario;
	-- Calculo la tasa de MORA DIARIA. PARA CALC. LA MORA DE CADA CUOTA. POR LOS DIAS VENC. QUE TENGAN	
	SELECT ((tasamora/100)/30) INTO @TasaMoraDiaria FROM prestamoc WHERE  usuariox=pusuario;
	
	-- calculo de la mora sobre mora.
	-- ================================
	-- 1) calculo la mora de cada cuota del prestamo normalmente.	
	  UPDATE  cuotac SET mora=(((interespendiente+capitalpendiente)*@TasaMoraDiaria) * diasvencido) WHERE usuariox=pusuario; 
        -- 2) calculo la mora como en el paso 1 pero a esta le sumo las moras de las cuotas anteteriores
	-- para esto se necesita hacer los siguiente: crear una copia de las cuotas del prestamo en una tablita.
	-- luego hacer el update con la copia y la original
        DROP TABLE IF EXISTS copia;	
	CREATE TABLE copia
		SELECT numero,mora FROM cuotac WHERE mora>0   AND usuariox=pusuario ORDER BY numero,mora;
	
		UPDATE cuotac SET cuotac.mora= cuotac.mora + 
		IFNULL((SELECT SUM(mora) FROM copia WHERE numero < cuotac.numero AND cuotac.mora>0 ORDER BY numero),0)
		WHERE  usuariox=pusuario;			
	-- DROP TABLE IF EXISTS copia;
	 -- 3) y por ultimo calculo la mora normalmente pero al interes y al capital pendiete le sumo la mora que tiene la cuota
	 UPDATE  cuotac SET mora=(((mora+interespendiente+capitalpendiente)*@TasaMoraDiaria) * diasvencido) WHERE   usuariox=pusuario; 	
		
	  CALL Cuota_Procesos(pusuario);
	  CALL Prestamo_Procesos(pusuario); 
END */$$
DELIMITER ;

/* Procedure structure for procedure `CalculoDiario` */

/*!50003 DROP PROCEDURE IF EXISTS  `CalculoDiario` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CalculoDiario`(
)
BEGIN
	DECLARE f VARCHAR(15);  -- fecha para el calculo diario
	DECLARE pp INT;	-- PRIMER registro
	DECLARE up INT;  -- ULTIMO registro
	DECLARE p INT;  -- prestamo
	
	/*BUSCO LA FECHA DEL ULTIMO CALCULO QUE SE HIZO.
	SI ESA FECHA ES DIFE. A LA FECHA DEL DIA,
	BUSCO EL PRIMER Y ULTI. PRESTAMO PARA HACER UN RECO DESDE EL PRIM. HASTA EL ULT.
	EMPIEZO EL RECCORIDO,
	MIENTRAS RECORR. CALCULO LA MORA DEL PRESTAMO POR EL QUE VOY, CON LA FECHA DEL DIA
	DESPUES. QUE TERMINE EL RECORR. PONGO LA FECHA DEL DIA EN COFIGURACION.*/
        DROP TABLE IF EXISTS pre;	
        
	CREATE TABLE pre
	(
	id INT UNSIGNED AUTO_INCREMENT NOT NULL PRIMARY KEY,
	prestamo INT
	);	
	INSERT INTO pre(prestamo)
	 SELECT numero FROM prestamo WHERE estatus IN('ORIGINAL','ABONADO') ORDER BY numero;
        -- select first numero into @usua from usuario limit 1;        
        SET @usua=2;
	
		SELECT MIN(id),MAX(id)   INTO pp,up  FROM pre ;
		WHILE pp <= up DO
			SELECT prestamo INTO p FROM pre WHERE id=pp;			
                         CALL copiatablas(p,@usua);			 
			 CALL CalculaMora(DATE(NOW()),@usua);
			 CALL actualizarDatos(@usua);
			SET pp=pp + 1;
		END WHILE;
	-- DROP TABLE IF EXISTS pre;
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `Captura_DescuentoInteres` */

/*!50003 DROP PROCEDURE IF EXISTS  `Captura_DescuentoInteres` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Captura_DescuentoInteres`(
recibo INTEGER,
pusuario INT
)
BEGIN
		DROP TABLE IF EXISTS r;
		CREATE TABLE r
		SELECT maestrodepago,SUM(interes) interes FROM detalledepagoc 
		WHERE maestrodepago=recibo AND nota='Interes descontado' AND usuariox=pusuario
		GROUP BY maestrodepago ;
		
		UPDATE maestrodepagoc m, r 
			SET m.DescuentoInteres=r.interes
		WHERE  m.Numero=r.maestrodepago AND m.numero=recibo AND usuariox=pusuario;		
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `CopiaDatos` */

/*!50003 DROP PROCEDURE IF EXISTS  `CopiaDatos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CopiaDatos`(
pRecibo INT,
pusuario INT
)
BEGIN
UPDATE prestamo a, prestamoc b SET a.Estatus=b.Estatus, 
                                   a.Estatusdc=b.Estatusdc,
                                   a.Estatus2=b.Estatus2
WHERE a.numero=b.numero AND b.usuariox=pusuario; 
                                  
UPDATE cuota a, cuotac b
SET  a.Mora = b.Mora, a.Interes = b.Interes, a.InteresPagado = b.InteresPagado, a.InteresPendiente = b.InteresPendiente, 
a.Capital = b.Capital, a.CapitalPagado = b.CapitalPagado, a.CapitalPendiente = b.CapitalPendiente, a.Cuota = b.Cuota, 
a.DiasVencido = b.DiasVencido, a.DiasPago = b.DiasPago, a.Estatus = b.Estatus
WHERE a.Registro = b.Registro AND b.usuariox=pusuario;
INSERT INTO maestrodepago(Prestamo, Efectivo, Cheque, Tarjeta, Mora, DescuentoInteres, TipoDePago, NotaDeCredito, Nota, Comision, Fecha, Estatus, TotalPagado, Usuario, Sucursal, TotalARebajar, InteresPendiente, CapitalPendiente, TotalPendiente, Capital, cancelado, usuariocancela, fechacancela, FechaHoy, Hora,inicial)
SELECT Prestamo, Efectivo, Cheque, Tarjeta, Mora, DescuentoInteres, TipoDePago, NotaDeCredito, Nota, Comision, Fecha, Estatus, TotalPagado, Usuario, Sucursal, TotalARebajar, InteresPendiente, CapitalPendiente, TotalPendiente, Capital, cancelado, usuariocancela, fechacancela, FechaHoy, Hora,inicial
FROM maestrodepagoc
WHERE numero =pRecibo AND usuariox=pusuario;
INSERT INTO detalledepago(MaestroDePago, Cuota, DiasPago, Interes, Capital, Prestamo, Concepto, Nota)
SELECT  MaestroDePago, Cuota, DiasPago, Interes, Capital, Prestamo, Concepto, Nota
FROM detalledepagoc WHERE maestrodepago=pRecibo  AND usuariox=pusuario;
	
END */$$
DELIMITER ;

