DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CopiarReporte`(
PReporteAnterior VARCHAR(100),
 PNuevoReporte VARCHAR(100)	
)
SALIR:BEGIN	
   IF (SELECT reporte FROM componente WHERE reporte=PReporteAnterior LIMIT 1) IS NULL THEN
   LEAVE salir;
   END IF;   
  
 CREATE TEMPORARY TABLE IF NOT EXISTS c
 SELECT * FROM componente WHERE reporte=PReporteAnterior;
 
 UPDATE c SET reporte=PNuevoReporte;
 
 INSERT INTO componente 
 SELECT * FROM c;
 
 -- COPIO LA CONSULTA
   IF (SELECT reporte FROM componente WHERE reporte=PReporteAnterior LIMIT 1) IS NOT NULL THEN
	CREATE TEMPORARY TABLE IF NOT EXISTS B
	SELECT * FROM CONSULTA WHERE reporte=PReporteAnterior;
	
	UPDATE B SET reporte=PNuevoReporte;
	
	INSERT INTO CONSULTA 
	SELECT * FROM B;
   END IF;
 
	
END */$$
