/* Procedure structure for procedure `creacuotas` */

/*!50003 DROP PROCEDURE IF EXISTS  `creacuotas` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `creacuotas`(
	Pplazo 			INTEGER,
	ptasa 			DOUBLE(12,4),
	pmontototalprestamo	DOUBLE(20,4),
	Pfechaprestamo 		VARCHAR(10),
	psepaga 			VARCHAR(50),	
	pcodigoprestamo 		VARCHAR(45),
	pmetodoPrestamo 		VARCHAR(20),
	ptipo			VARCHAR(20) 
)
BEGIN
	DECLARE vcontador 	INT 	DEFAULT 0;
	DECLARE vcuota 		DOUBLE(20,4) 	DEFAULT 0;
	DECLARE vcapital 		DOUBLE(20,4) 	DEFAULT 0;
	DECLARE vinteres 		DOUBLE(20,4) 	DEFAULT 0;
	DECLARE vexp 		DOUBLE(12,6) 	DEFAULT 0;
	DECLARE vplazo 		INTEGER		DEFAULT 0;
	IF PSEPAGA	='ANUAL' 		THEN SET PTASA=(PTASA*12)/100;
	ELSEIF PSEPAGA	='SEMESTRAL' 	THEN SET PTASA=(PTASA*6)/100;	 	
	ELSEIF PSEPAGA	='CUATRIMESTRAL' THEN SET  PTASA=(PTASA*4)/100;
	ELSEIF PSEPAGA	='TRIMESTRAL' 	THEN SET PTASA=(PTASA*3)/100;
	ELSEIF PSEPAGA	='MENSUAL' 	THEN SET PTASA=PTASA/100;	 
	ELSEIF PSEPAGA	='QUINCENAL' 	THEN SET PTASA=(PTASA/2)/100;
	ELSEIF PSEPAGA	='BISEMANAL'	THEN SET PTASA=(PTASA/2)/100;	
	ELSEIF PSEPAGA	='SEMANAL'	THEN SET PTASA=(PTASA/4)/100;		
	ELSEIF PSEPAGA	='DIARIO' 		THEN SET PTASA=(PTASA/30)/100;
	END IF;	
	IF pmetodoPrestamo ='FRANCES' THEN  
		SET vexp=POWER(1+ptasa,pplazo);
		SET vcuota=(((ptasa*vexp)/(vexp-1))* pmontototalprestamo);
		WHILE pplazo>0 DO
			SET vcontador=vcontador+1;
                        
                        
                        -- ultimo cambio 
                           IF (ptipo)='TEMPORAL' THEN                            
                                SET @diasfijos=(SELECT diasfijos FROM prestamotemporal WHERE numero=pcodigoprestamo);                           
                            ELSE
                                SET @diasfijos=(SELECT diasfijos FROM prestamo WHERE numero=pcodigoprestamo); 
                            END IF;
                                                    
                        
                        
                         --  ESTA PARTE LA MODIFIQUE PARA QUE SE PONGA LA FECHA DE INICIO EN LA PRIMERA CUOTA                        
			IF VCONTADOR>1 THEN									
				SET pfechaprestamo = `AjustaFecha`(@diasfijos,pfechaprestamo,psepaga);
			END IF;
			
			
			
			SET vinteres= pmontototalprestamo *ptasa;
			
			IF PTIPO='PERMANENTE' THEN
			INSERT INTO cuota(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcuota-vinteres,vcuota,pcodigoprestamo);
			ELSEIF PTIPO='TEMPORAL' THEN
			INSERT INTO cuotaTemporal(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcuota-vinteres,vcuota,pcodigoprestamo);                       	  	   	                       	  	   
			END IF;
			SET pmontototalprestamo = pmontototalprestamo -(vcuota-vinteres);
			SET pplazo=pplazo-1;
		END WHILE;
		SET vcapital= pmontototalprestamo / pplazo;
	ELSEIF pmetodoPrestamo ='ITALIANO' THEN     
		SET vcapital=pmontototalprestamo/pplazo;		
		WHILE pplazo>0 DO
			SET vcontador	=vcontador+1;
					
                         --  ESTA PARTE LA MODIFIQUE PARA QUE SE PONGA LA FECHA DE INICIO EN LA PRIMERA CUOTA                        
			IF VCONTADOR>1 THEN									
				SET pfechaprestamo = `AjustaFecha`(@diasfijos,pfechaprestamo,psepaga);
			END IF;
			
			
			SET vinteres	= pmontototalprestamo*ptasa;
			IF PTIPO='PERMANENTE' THEN
			INSERT INTO cuota(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcapital+vinteres,pcodigoprestamo);
			ELSEIF PTIPO='TEMPORAL' THEN
			INSERT INTO cuotaTemporal(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcapital+vinteres,pcodigoprestamo);
			END IF;
			SET pmontototalprestamo = pmontototalprestamo -(vcapital);
			SET pplazo=pplazo-1;
		END WHILE;				
	ELSEIF pmetodoPrestamo ='SIMPLE' THEN  
		SET vcapital= pmontototalprestamo /pplazo;
		SET vinteres= pmontototalprestamo *ptasa;
		SET vcuota=vcapital+vinteres;
		WHILE pplazo>0 DO
			SET vcontador=vcontador+1;
			
			--  ESTA PARTE LA MODIFIQUE PARA QUE SE PONGA LA FECHA DE INICIO EN LA PRIMERA CUOTA                        
			IF VCONTADOR>1 THEN									
				SET pfechaprestamo = `AjustaFecha`(@diasfijos,pfechaprestamo,psepaga);
				-- si es diario y
				-- si es domingo entonces saltar el dia.                                
                                 IF psepaga='diario' THEN				
					IF DAYOFWEEK(pfechaprestamo)=1 THEN
						SET pfechaprestamo = `SumaDiasAFecha`(pfechaprestamo,1); 
					END IF;
				 END IF;
			END IF;   
                        
			
			IF PTIPO='PERMANENTE' THEN
			INSERT INTO cuota(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcuota,pcodigoprestamo);
			ELSEIF PTIPO='TEMPORAL' THEN
			INSERT INTO cuotaTemporal(numero,vencimiento,interes,capital,cuota,prestamo)				
                       	  	   	VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcuota,pcodigoprestamo);
			END IF;
			SET pplazo=pplazo-1;
		END WHILE;
	ELSEIF pmetodoPrestamo='AMERICANO' THEN  
		SET vcapital=0;
		SET vinteres= pmontototalprestamo *ptasa;
		SET vcuota=vcapital+vinteres;
		SET vplazo=pplazo;
		WHILE pplazo>0 DO
			SET vcontador=vcontador+1;
			
			--  ESTA PARTE LA MODIFIQUE PARA QUE SE PONGA LA FECHA DE INICIO EN LA PRIMERA CUOTA                        
			IF VCONTADOR>1 THEN									
				SET pfechaprestamo = `AjustaFecha`(@diasfijos,pfechaprestamo,psepaga);
				
				-- si es diario y
				-- si es domingo entonces saltar el dia.                                
                                 IF psepaga='diario' THEN				
					IF DAYOFWEEK(pfechaprestamo)=1 THEN
						SET pfechaprestamo = `SumaDiasAFecha`(pfechaprestamo,1); 
					END IF;
				 END IF;
			END IF;
			
			IF PTIPO='PERMANENTE' THEN
				INSERT INTO cuota(numero,vencimiento,interes,capital,cuota,prestamo)				
						VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcuota,pcodigoprestamo);
			ELSEIF PTIPO='TEMPORAL' THEN
				INSERT INTO cuotaTemporal(numero,vencimiento,interes,capital,cuota,prestamo)				
						VALUES(vcontador,pfechaprestamo,vinteres,vcapital,vcuota,pcodigoprestamo);
			END IF;	
			SET pplazo=pplazo-1;
		END WHILE;
		
		
		IF PTIPO='PERMANENTE' THEN
			UPDATE cuota SET 
			capital= pmontototalprestamo, 
			cuota=vinteres+ pmontototalprestamo
			WHERE prestamo=pcodigoprestamo AND numero=vplazo ORDER BY prestamo,numero;
		ELSEIF PTIPO='TEMPORAL' THEN
			UPDATE CuotaTemporal SET 
			capital= pmontototalprestamo, 
			cuota=vinteres+ pmontototalprestamo
			WHERE prestamo=pcodigoprestamo AND numero=vplazo ORDER BY prestamo,numero;				
		END IF;			
	END IF;
	
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `CreaDetalledepago` */

/*!50003 DROP PROCEDURE IF EXISTS  `CreaDetalledepago` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `CreaDetalledepago`(pRecibo INT, pusuario INT)
BEGIN  
	DECLARE vmaximacuota INTEGER DEFAULT 0;
	DECLARE vcontador INTEGER DEFAULT 1;
	DECLARE vAbono, vnotacredito,vti,vca,Vcomision,vcapitalpendiente, vinterespendiente,vmorapendiente,vdescuentointeres,vmorapendienteapagar,vinteres,vdiasapagar,vcapital,vtotalapagar,VinteresApagar,vcapitalApagar,vmoraapagar,vmoraaperdonar DOUBLE(12,2);
	DECLARE vnota,vmetodoprestamo,vme,vse VARCHAR(100);
	
	CALL Cuota_Procesos(pusuario);	
	
	SELECT MAX(numero) INTO vmaximacuota FROM CUOTAc WHERE usuariox=pusuario;
		
        SELECT  descuentointeres, notadecredito , totalarebajar-(descuentointeres+notadecredito),prestamo, inicial, comision
        INTO  vdescuentointeres, vnotacredito , vtotalapagar,@prestamo,@inicial,Vcomision
        FROM maestrodepagoc WHERE numero=pRecibo AND usuariox=pusuario;  
              	
        SELECT metodo INTO vmetodoprestamo FROM prestamoc WHERE usuariox=pusuario;
	        
      	-- numero en detalledepago
	SET @detalle=(SELECT AUTO_INCREMENT FROM information_schema.TABLES WHERE table_name='detalledepago' AND table_schema="prestamos2");
	
        
        	
       	/*PAGA COMISION*/	
	IF vcomision > 0 THEN	  
	   INSERT INTO detalledepagoc(numero,prestamo,MaestroDePago,nota,usuariox)
                              SELECT @detalle,@prestamo,pRecibo, 'Comision',pusuario;                             
           SET vcomision=0;                                        
	END IF; 
	
            	
	
        
        	
	/*PAGA DESCUENTO DE INTERES*/
        SET @detalle=@detalle+1;
	SET vcontador = 1;	
	WHILE vcontador <= Vmaximacuota DO
	
	/*MORA: envio los diasvencidos a detalledepago, si no es un inicial
	es es para crear el detalle de la mora*/	
	IF @inicial = 0 THEN	  
	   INSERT INTO detalledepagoc(numero,prestamo,cuota,MaestroDePago,diaspago,usuariox)
           SELECT @detalle,prestamo,numero,pRecibo,diasvencido,pusuario FROM cuotac WHERE numero=vcontador AND diasvencido>0 AND usuariox=pusuario;
        -- actualizo los diaspago en cuota
            UPDATE cuotac c SET c.diaspago=IFNULL((SELECT SUM(diaspago) FROM detalledepagoc WHERE cuota=c.numero AND diaspago>0 AND usuariox=pusuario GROUP BY cuota),0)
            WHERE c.numero=vcontador AND usuariox=pusuario;	
	END IF; 
	
	SET @detalle=@detalle+1;
	SET vinteresApagar=0;   -- interespendiente de la cuota             #1...
	SET vinteres=IFNULL((SELECT interespendiente FROM cuotac WHERE numero=vcontador AND usuariox=pusuario),0);
	
	IF vdescuentointeres > 0 THEN 
	
		        IF (vinteres <= vdescuentointeres ) AND (vinteres>0)  THEN
			SET vinteresapagar=vinteres;
			SET vdescuentointeres = vdescuentointeres - vinteres;
			SET vinteres=0;
		        ELSEIF (vinteres > vdescuentointeres )  THEN
			SET vinteresapagar = vdescuentointeres ;
			SET vdescuentointeres =0;						
		        END IF;
	
	END IF;
		        IF vinteresapagar > 0 THEN	       	 
		       	 INSERT INTO detalledepagoc(    numero,prestamo,cuota,MaestroDePago,interes,nota,usuariox)
				 	VALUES(   @detalle,@prestamo,vcontador,pRecibo,vinteresapagar,'Interes Descontado',pusuario);
		        END IF;
		        SET @detalle=@detalle+1;
		SET vcontador = vcontador + 1;
	END WHILE;
		
	
	
	CALL Cuota_Procesos(pusuario);
	
	
	/*si es un abono al capital cobrar la deuda al dia con una nota, abono al capital*/	
      IF (SELECT tipodepago FROM maestrodepagoc WHERE numero=pRecibo AND usuariox=pusuario) ='abono al capital' THEN 
        SET vnota='abono al capital';
      ELSE 
        SET vnota='sin nota'; 
      END IF;  	
	
	
	/*PAGA INTERES Y CAPITAL (CUOTA)*/	
	SET vcontador = 1;
	WHILE vcontador <= Vmaximacuota DO
	SET vinteresApagar=0;
	SET vcapitalApagar=0;
		
	
    	SELECT interespendiente,capitalpendiente INTO vinteres,vcapital FROM cuotac WHERE  numero=vcontador AND usuariox=pusuario;
    	
		IF Vtotalapagar > 0 THEN 
		        IF (vinteres <= Vtotalapagar) AND (vinteres>0)  THEN
			SET vinteresapagar=vinteres;
			SET Vtotalapagar = Vtotalapagar - vinteres;
			SET vinteres=0;
		        ELSEIF (vinteres > Vtotalapagar )  THEN
			SET vinteresapagar = Vtotalapagar;
			SET Vtotalapagar =0;						
		        END IF;
	
	
	
		        IF (vcapital <= Vtotalapagar ) AND (vcapital >0)  THEN
			SET vcapitalapagar=vcapital;
			SET Vtotalapagar = Vtotalapagar - vcapitalapagar;
		        ELSEIF (vcapital > Vtotalapagar )  THEN
			SET vcapitalapagar= Vtotalapagar ;			
			SET Vtotalapagar =0;						
		        END IF;	
		END IF;
	
		        IF vinteresapagar + vcapitalapagar > 0 THEN
		       	 INSERT INTO detalledepagoc(    numero,prestamo,cuota,MaestroDePago,interes,capital,nota,usuariox)
				 	VALUES(   @detalle,@prestamo,vcontador,pRecibo,vinteresapagar,vcapitalapagar,vnota,pusuario);
		        END IF;
		        SET @detalle=@detalle+1;
		        
		SET vcontador = vcontador + 1;
	END WHILE;	
		
	
	
	
	CALL Cuota_Procesos(pusuario);
	
	
	-- abono al capital  por abajo
	SET vcapital=( SELECT capital FROM maestrodepagoc WHERE numero=pRecibo AND usuariox=pusuario);
		
	
	-- ME ASEGURO QUE EL CAPITAL A PAGAR SEA <= AL CAPITAL PENDIENTE Y QUE SEA MAYOR A CERO
	 IF (vcapital <= IFNULL((SELECT SUM(capitalpendiente) FROM cuotac WHERE usuariox=pusuario),0)) AND vcapital>0 THEN		
		-- CAPTURO LA PRIMERA CUOTA ABONADA
		SET vcontador = IFNULL((SELECT MIN(numero) FROM cuotac WHERE  capitalpendiente>0 AND usuariox=pusuario),0);		
		
		-- EMPIEZO A PAGAR DE ABAJO PARA ARRIBA
		WHILE Vmaximacuota >= vcontador DO
		SET vinteresApagar=0;
		SET vcapitalApagar=0;		         			
		-- CAPTURO EL INTERES Y EL CAPITAL PENDIENTE .
                IF (SELECT metodo FROM prestamoc WHERE usuariox=pusuario)='AMERICANO' THEN 		
		     SELECT 0, capitalpendiente INTO vinterespendiente,vcapitalpendiente  FROM cuotac WHERE  numero=Vmaximacuota AND usuariox=pusuario;				
		ELSE
		    SELECT interespendiente, capitalpendiente INTO vinterespendiente,vcapitalpendiente  FROM cuotac WHERE  numero=Vmaximacuota AND usuariox=pusuario;				
		END IF;
		
		-- descuento el interes	
		IF vinterespendiente > 0  AND vcapital > 0 THEN 	
			SET vinteresApagar = vinterespendiente; -- vinteres * vcapital;						
			SET vinterespendiente =0;			
		END IF;
		
				IF  vinteresApagar > 0 THEN
				INSERT INTO detalledepagoc(    numero,prestamo,cuota,MaestroDePago,capital,interes,nota,usuariox)
						VALUES(   @detalle,@prestamo,Vmaximacuota,pRecibo,0,vinteresApagar,'Interes Descontado por abono',pusuario); -- se descuenta el interes porque es un abono al capital
											
				END IF;
				
				SET @detalle=@detalle+1;
		            
		-- ahora cobro el capital		
		IF vcapital > 0 THEN 		
				IF (vcapitalpendiente <= vcapital ) AND (vcapitalpendiente>0)  THEN
					SET vcapitalApagar=vcapitalpendiente;
					SET vcapital = vcapital - vcapitalpendiente;
					SET vcapitalpendiente=0;
				ELSEIF (vcapitalpendiente > vcapital )  THEN
					SET vcapitalApagar = vcapital ;
					SET vcapital = 0;							
					SET vcapitalpendiente =0;						
				END IF;		
		END IF;
		
				IF vcapitalApagar > 0 THEN
				INSERT INTO detalledepagoc(    numero,prestamo,cuota,MaestroDePago,capital,interes,nota,usuariox)
						VALUES(   @detalle,@prestamo,Vmaximacuota,pRecibo,vcapitalApagar,0,'Abono al capital',pusuario);
											
				END IF;	
				SET @detalle=@detalle+1;			
			SET Vmaximacuota = Vmaximacuota - 1;
		END WHILE;
		
	 END IF;		
		
	
	CALL Cuota_Procesos(pusuario);	
	
	
	
	/*PAGA NOTA DE CREDITO, esto es para que en el reporte de ingresos no se tomen en cuenta
	  la mora, interes y capital pagado con nota de credito*/
	SET vcontador = 1;
	WHILE vcontador <= Vmaximacuota DO
	SET vinteresApagar=0;
	SET vcapitalApagar=0;
		
	
    	SELECT interespendiente,capitalpendiente INTO vinteres,vcapital FROM cuotac WHERE numero=vcontador AND usuariox=pusuario;
    	
		IF Vnotacredito > 0 THEN 
		        IF (vinteres <= Vnotacredito) AND (vinteres>0)  THEN
			SET vinteresapagar=vinteres;
			SET Vnotacredito = Vnotacredito - vinteres;
			SET vinteres=0;
		        ELSEIF (vinteres > Vnotacredito )  THEN
			SET vinteresapagar = Vnotacredito;
			SET Vnotacredito =0;						
		        END IF;
	
	
	
		        IF (vcapital <= Vnotacredito ) AND (vcapital >0)  THEN
			SET vcapitalapagar=vcapital;
			SET Vnotacredito = Vnotacredito - vcapitalapagar;
		        ELSEIF (vcapital > Vnotacredito )  THEN
			SET vcapitalapagar= Vnotacredito ;			
			SET Vnotacredito =0;						
		        END IF;	
		END IF;
	
		        IF vinteresapagar + vcapitalapagar > 0 THEN
		       	 INSERT INTO detalledepagoc(    numero,prestamo,cuota,MaestroDePago,interes,capital,nota,usuariox)
				 	VALUES(   @detalle,@prestamo,vcontador,pRecibo,vinteresapagar,vcapitalapagar,"Nota de credito",pusuario);
		        END IF;
		        SET @detalle=@detalle+1;
		SET vcontador = vcontador + 1;
	END WHILE;	
	
        
	CALL Cuota_Procesos(pusuario);
       	
	
			
		
	
	-- quitar esto de comentario para que el interes se recalcule en el metodo americano
        
	
	 -- recalculo el interes de cada cuota donde el interespagado=0
	/*	SELECT metodo,sepaga,tasainteres INTO vme,vse,vti FROM prestamoc WHERE usuariox=pusuario;
		SELECT capitalpendiente INTO vca FROM cuotac WHERE usuariox=pusuario ORDER BY numero DESC LIMIT 1;         	
		IF vme='AMERICANO' THEN	 
			UPDATE cuotac SET interes=ftasa(vse,vti) * vca WHERE interespagado=0 AND usuariox=pusuario;
		END IF;
						
	CALL Cuota_Procesos(pusuario);
	*/
		
END */$$
DELIMITER ;

/* Procedure structure for procedure `Cuota_Procesos` */

/*!50003 DROP PROCEDURE IF EXISTS  `Cuota_Procesos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Cuota_Procesos`(
pusuario INT
)
BEGIN
		DECLARE ultimacuotac INT DEFAULT 0;
		DECLARE contador INT DEFAULT 1;
		 DECLARE m,i,c,mp,ip,cp DOUBLE(12,2) DEFAULT 0;		
		DECLARE dv INT DEFAULT 0; -- dias vencidos
		
		SET Ultimacuotac=(SELECT IFNULL(MAX(numero),0) FROM cuotac WHERE  usuariox=pusuario);
				
/*CALCULA LO PAGADO Y LO PONE EN cuotac*/
		SET contador=1;
		-- RECORRO
		WHILE contador <= Ultimacuotac DO
		--  HAGO ESTO PORQUE SI Detalledepagoc ESTA VACIA ME DEVUELVE UN VALOR NULO Y DA ERROR AL ASIGNARSELO A MORAPAGADA ETC.
		    (SELECT  IFNULL(SUM(interes),0), IFNULL(SUM(capital),0) INTO i,c FROM Detalledepagoc  WHERE cuota = contador  AND usuariox=pusuario ORDER BY cuota) ;	     		
			-- RECOJO EL INTERES, MORA Y CAPITAL PAGADO DE ESTE PRESTAMO EN Detalledepagoc Y LO PONGO EN cuotac			
			UPDATE cuotac SET	
			     interespagado=i,
			     capitalpagado=c
			WHERE numero=contador   AND usuariox=pusuario;
			
			-- AVANSO A LA SIG. cuotac.			
		-- AVANSO A LA SIG. cuotac.*/	
			SET contador = contador + 1;			
		END WHILE;
		
		
			-- CALCULO el INTERES Y CAPITAL PENDIENTE		
		        UPDATE cuotac SET	
			     interespendiente= CASE WHEN interes>0 THEN interes-interespagado ELSE 0 END,
			     capitalpendiente= CASE WHEN capital>0 THEN capital-capitalpagado ELSE 0 END
			WHERE  usuariox=pusuario;
		-- ====================================
			-- SI LA cuotac NO TIENE PAGO, ES ORIGINAL			
			UPDATE cuotac SET estatus='ORIGINAL' WHERE (interespagado+capitalpagado<=0)   AND usuariox=pusuario ;			
			-- SI LA cuotac TIENE PAGO, ES ABONADA
			UPDATE cuotac SET estatus='ABONADA' WHERE (interespagado+capitalpagado>0)   AND usuariox=pusuario;		         
			-- SI LA cuotac ES IGUAL AL INTERES Y EL CAPITAL PAGO, ES SALDADA	
			UPDATE cuotac SET estatus='SALDADA' WHERE (INTERESPENDIENTE+CAPITALPENDIENTE<1)   AND usuariox=pusuario;		
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `llamada` */

/*!50003 DROP PROCEDURE IF EXISTS  `llamada` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `llamada`()
BEGIN  
DROP TABLE  IF EXISTS atrazo;  
   DROP TABLE  IF EXISTS atrazos; 
   DROP TABLE  IF EXISTS cllamada; 
   DROP TABLE  IF EXISTS cllamada2;   
   
   
   CREATE TABLE atrazo    
   SELECT 000000000 prestamo, 00 v,00 p,00000000000.00mv,000000000000.00 mp ;
   
   INSERT INTO  atrazo    
   SELECT c.prestamo,COUNT(c.numero) v,0 p,SUM(interespendiente+capitalpendiente+mora)mv,000000000000.00 mp  FROM cuota c, prestamo p      
   WHERE c.estatus IN("original","abonada") AND c.diasvencido>0
   AND c.prestamo=p.Numero AND p.estatus NOT IN("Cancelado","Saldado") 
   GROUP BY c.prestamo   
   ORDER BY c.prestamo,c.numero ;
   
   INSERT INTO  atrazo  
   SELECT c.prestamo, 0, COUNT(c.numero),0,SUM(interespendiente+capitalpendiente+mora)   FROM cuota c, prestamo p      
   WHERE c.estatus IN("original","abonada")
   AND c.prestamo=p.Numero AND p.estatus NOT IN("Cancelado","Saldado") 
   GROUP BY c.prestamo   
   ORDER BY c.prestamo,c.numero ;
   
      
   CREATE TABLE  atrazos
   SELECT prestamo,CONCAT(SUM(v),"/",SUM(p)) cuotas, CONCAT(ROUND(SUM(mv)),"/",ROUND(SUM(mp))) monto FROM atrazo
   GROUP BY prestamo
   HAVING SUM(v)>0 AND SUM(p)>0 
   ORDER BY prestamo;     
   
   -- llamadas
   CREATE TABLE cllamada
   SELECT 00000000 prestamo, 00 realizada,00 pendiente, 00 atrazo;
   
   INSERT INTO cllamada 
   SELECT prestamo, COUNT(numero) realizada,00 pendiente, 00 atrazo FROM llamada
   WHERE estatus='Realizada'
   GROUP BY prestamo
   ORDER BY prestamo;
   INSERT INTO cllamada   
   SELECT prestamo, 00,COUNT(numero),00  FROM llamada
   WHERE estatus='Pendiente'
   GROUP BY prestamo
   ORDER BY prestamo;
   
   INSERT INTO cllamada   
   SELECT prestamo, 00,00, COUNT(numero) FROM llamada
   WHERE fecha<= DATE(NOW()) AND estatus<>'Realizada'
   GROUP BY prestamo
   ORDER BY prestamo;
   
   CREATE TABLE cllamada2
   SELECT prestamo,SUM(realizada) realizada,SUM(pendiente) pendiente, SUM(atrazo) atrazo FROM cllamada
   GROUP BY prestamo;
   SELECT c.nombre cliente,c.celular, c.telefono, 
       p.numero prestamo ,
       CAST(a.cuotas AS CHAR) cuotas ,
       CAST(a.monto AS CHAR) monto ,
       ll.realizada,
       ll.pendiente,
       ll.atrazo       
 FROM prestamo p INNER JOIN cliente c ON c.numero=p.cliente
 INNER JOIN atrazos  a ON p.Numero=a.prestamo
 LEFT JOIN cllamada2 ll  ON p.numero=ll.prestamo
   GROUP BY p.Numero
   ORDER BY c.Nombre;
   
   DROP TABLE  IF EXISTS atrazo;  
   DROP TABLE  IF EXISTS atrazos; 
   DROP TABLE  IF EXISTS cllamada; 
   DROP TABLE  IF EXISTS cllamada2; 
END */$$
DELIMITER ;

/* Procedure structure for procedure `PagoElectronico` */

/*!50003 DROP PROCEDURE IF EXISTS  `PagoElectronico` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `PagoElectronico`(
FechEfec DATE, /*FECHA DE CUANDO EL BANCO TIENE QUE COBRAR*/
CodiBancDest VARCHAR(8), -- 10101010
Pdesde DATE, -- deste este vencimiento
pHasta DATE  -- hasta este vencimiento de la cuota
)
BEGIN	
	/*PONE EL DIGITO VERIFICADOR DEL BANCO ESPECIFICADO*/
	SET @digVerBD= CASE 
						WHEN codiBancDest='10101010' THEN  '6'
						WHEN codiBancDest='10101030' THEN  '0'
						WHEN codiBancDest='10101060' THEN  '1'
						WHEN codiBancDest='10101070' THEN  '8'
						WHEN codiBancDest='10101110' THEN  '5'
						WHEN codiBancDest='10101230' THEN  '8'
						WHEN codiBancDest='10101300' THEN  '6'
						WHEN codiBancDest='10101340' THEN  '4'
						WHEN codiBancDest='10101350' THEN  '1'
						WHEN codiBancDest='10101360' THEN  '8'
						WHEN codiBancDest='10101370' THEN  '5'
						WHEN codiBancDest='10101380' THEN  '2'
						WHEN codiBancDest='10101390' THEN  '9'
						WHEN codiBancDest='10171228' THEN  '4'
						WHEN codiBancDest='11102328' THEN  '0'
						WHEN codiBancDest='44405900' THEN  '2'
						WHEN codiBancDest='47940900' THEN  '9'
						WHEN codiBancDest='48991200' THEN  '7'
						WHEN codiBancDest='25141012' THEN  '2'
					END;
		  
	/*LA SECUENCIA SE INCREMENTA EN UNO POR DIA
	SI EL DIA ES DIFERENTE DE HOY, INICIALIZA LA SECUENCIA A 1 Y PONE LA FECHA = HOY 
	SINO LA INCREMENTA EN UNO*/		
	IF((SELECT fecha FROM Configuracion)<>DATE(NOW())) OR 
	   (SELECT fecha FROM Configuracion) IS NULL THEN
	UPDATE Configuracion SET secuencia=1, fecha=DATE(NOW());	
	ELSE UPDATE Configuracion SET secuencia=SECUENCIA+1;
	END IF; 
	
	
	
	DROP TEMPORARY TABLE IF EXISTS TransaccionesN;
	CREATE TEMPORARY TABLE TransaccionesN 
	(	
	TipoRegi VARCHAR(1) DEFAULT 'N',
	IdComp VARCHAR(15),
	nombComp VARCHAR(35),
	Secu INT(7)  ZEROFILL,
	secuTran INT(7)  ZEROFILL AUTO_INCREMENT,	
	CuenDest VARCHAR(20),
	TipoCuenDest VARCHAR(1),
	MoneDest VARCHAR(3),
	CodiBancDest VARCHAR(8),
	DigiVeriBancDest VARCHAR(1),	
	CodiOper VARCHAR(2),	
	MontTran INT(13) ZEROFILL,
	TipoIden VARCHAR(2) DEFAULT 'CE',	
	Iden VARCHAR(15) ,
	Nomb VARCHAR(35),
	NumeRefe VARCHAR(12) DEFAULT '            ',
	DescEstaDest VARCHAR(40) ,
	FechVenc VARCHAR(4),	
	PRIMARY KEY  (`secuTran`)
	);
	
	
	/*FUNCIONES: 
	  LPAD Y RPAD= RELLENAN CON UN CARACTER DADO POR LA IZQUIRDA O DERECHA DE UNA CADENA*/
	-- ESTOS DATOS COMO EL RNC, NOMBRE ETC. SON DATOS DEL CLIENTE. (PERSONA)
	INSERT INTO TransaccionesN(IDCOMP,nombComp,SECU,CuenDest,TipoCuenDest,MoneDest,CodiBancDest,
	DigiVeriBancDest,CodiOper,montTran,Iden,Nomb,DescEstaDest,FechVenc) 
	SELECT RPAD(co.rnc,15,' ') IdComp, -- por rnc
	RPAD(cl.nombre,35,' ') nombComp,
	co.secuencia	Secu,
	RPAD(cl.cuenta,20,' ') CuenDest,
	cl.tipoCuenta TipoCuenDest,
	'214' MoneDest,
	CodiBancDest,
	@DigVerBD,
	CASE WHEN cl.tipocuenta=1 THEN 27 ELSE 37 END  AS CodiOper, 
	REPLACE(c.cuota+0.01,'.','') AS MontTran,
	RPAD(REPLACE(cl.cedula,'-',''),15,' ') Iden,
	RPAD(cl.nombre,35,' ') nomb,
	RPAD(pr.sepaga,40,' ') DescEstaDest,	
	-- REPLACE((SELECT CONCAT(LPAD(MONTH(MAX(c.vencimiento)),2,'0'), LPAD(DAY(MAX(c.vencimiento)),2,'0')) FROM cuota c WHERE c.prestamo=pr.numero ORDER BY c.prestamo),'-','') FechVenc
	CONCAT( LPAD(MONTH(c.vencimiento),2,'0'), LPAD(DAY(c.vencimiento),2,'0') ) FechVenc
	FROM 	cliente CL,
			cuota c,
			PRESTAMO PR,
			Configuracion co
	WHERE 	CL.Numero=pr.cliente
	AND	PR.Numero=c.prestamo	
	AND 	CL.COBROAUTOMATICO=TRUE
	AND	PR.ESTATUS IN('ORIGINAL','ABONADO')
	AND 	c.ESTATUS<>'SALDADA'
	AND 	c.vencimiento BETWEEN pdesde AND phasta	
	GROUP BY c.prestamo
	ORDER BY cl.numero, pr.Numero;
		
	
	
	-- Este encabezado el rnc, empresa etc. son datos del prestamista
	DROP TEMPORARY TABLE IF EXISTS EncabezadoH;
	CREATE TEMPORARY TABLE EncabezadoH 
	SELECT  COUNT(*) CantDB,
		LPAD(co.numeroAsignado,5,'0') numeAsig,
		REPLACE(fechEfec,'-','') fechEfec,
		REPLACE(DATE(NOW()),'-','') fech,
		CONCAT(LPAD(HOUR(NOW()),2,'0'),LPAD(MINUTE(NOW()),2,'0')) hora,
		LPAD(REPLACE(SUM(SUBSTRING(t.monttran,1,11))+(SUM(SUBSTRING(t.monttran,12,13))/100),'.',''),13,'0') AS MontTotaDB,
		LPAD('',15,'0') NumeAfil,
		t.* 
	FROM TransaccionesN t, Configuracion co
	GROUP BY secu;
END */$$
DELIMITER ;

/* Procedure structure for procedure `PendienteParaRecibo` */

/*!50003 DROP PROCEDURE IF EXISTS  `PendienteParaRecibo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `PendienteParaRecibo`(
pprestamo VARCHAR(10), pRecibo VARCHAR(10),pusuario INT
)
BEGIN
	SELECT SUM(interespendiente),SUM(capitalpendiente) 
	INTO @interespendiente,@capitalpendiente
	FROM cuotac WHERE usuariox=pusuario;
	
	UPDATE maestrodepagoc SET
	interespendiente=@interespendiente,
	capitalpendiente=@capitalpendiente
	WHERE numero=pRecibo AND usuariox=pusuario;
END */$$
DELIMITER ;

