/* Procedure structure for procedure `PoneConceptoDetalledepago` */

/*!50003 DROP PROCEDURE IF EXISTS  `PoneConceptoDetalledepago` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `PoneConceptoDetalledepago`(
ppago INT,pusuario INT
)
BEGIN
DECLARE vinicio INT DEFAULT 0;
DECLARE vfin INT DEFAULT 0;
DECLARE vconcepto VARCHAR(20);
SELECT MIN(numero),MAX(numero) INTO vinicio,vfin FROM detalledepagoc WHERE maestrodepago=ppago AND usuariox=pusuario;
WHILE vinicio <=vfin DO
	SELECT concepto INTO vconcepto FROM detalledepagoc WHERE numero=vinicio AND usuariox=pusuario;
	IF (vconcepto='') OR (vconcepto IS NULL) THEN	
	UPDATE detalledepagoc dp SET dp.concepto=
	(  SELECT CASE estatus 
	            WHEN 'SALDADA' THEN 'SALDO CUOTA' 
	            WHEN 'ABONADA' THEN 'ABONO CUOTA' 
	          END 
	   FROM cuotac WHERE  numero=dp.cuota AND usuariox=pusuario)
	WHERE dp.numero=vinicio AND dp.usuariox=pusuario;
		
	END IF;
	
SET vinicio=vinicio + 1;
END WHILE;
END */$$
DELIMITER ;

