/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Prestamo_castigar`(
pprestamo INT, pCuotaInicial INT,pusuario INT
)
SALIR:BEGIN	
        CALL copiatablas(pprestamo,pusuario);		
	UPDATE cuotac SET mora=0,interes=0 WHERE prestamo=pprestamo AND numero>=pcuotainicial AND usuariox=pusuario;	
	CALL Cuota_Procesos(pusuario);
	CALL Prestamo_Procesos(pusuario);
	CALL ActualizarDatos(pusuario);
END */$$
