/* Procedure structure for procedure `prestamo_Procesos` */

/*!50003 DROP PROCEDURE IF EXISTS  `prestamo_Procesos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `prestamo_Procesos`(
pusuario INT
)
BEGIN
		 DECLARE m,i,c,mp,ip,cp DOUBLE(12,2) DEFAULT 0;		
		DECLARE dv INT DEFAULT 0; -- dias vencidos
			
		-- SI LO PAGADO ES CERO, ES ORIGINAL
		SELECT IFNULL(SUM(interespendiente),0),IFNULL(SUM(capitalpendiente),0),IFNULL(SUM(interespagado),0),IFNULL(SUM(capitalpagado),0) INTO  i, c,ip,cp FROM cuotac WHERE  usuariox=pusuario;
		UPDATE prestamoc SET estatus='ORIGINAL' WHERE  (ip+cp <=0)  AND (estatus<>'CANCELADO')   AND usuariox=pusuario;
		-- SI LO PAGADO ES MAYOR QUE CERO Y LO PENDIENTE ES > 0, ES ABONADO	
		UPDATE prestamoc SET estatus='ABONADO' WHERE  (ip+cp >0) AND (i+c>0)  AND (estatus<>'CANCELADO')   AND usuariox=pusuario;
		-- SI LO PENDIENTE ES 0, ES SALDADO
		UPDATE prestamoc SET estatus='SALDADO',estatusDC='S' WHERE  (i+c<=1) AND (estatus<>'CANCELADO')   AND usuariox=pusuario;
		
		-- N=NORMAL  A=ATRASO  S=SALDADO L=LEGAL C=CASTIGADO
		-- ESTO PARA EL REPORTE DE DATA CREDITO	
		SELECT IFNULL(SUM(DIASVENCIDO),0) INTO dv FROM cuotac WHERE estatus NOT IN('CANCELADa','saldada')   AND usuariox=pusuario;
		UPDATE prestamoc SET estatusDC='N' WHERE dv=0 AND ESTATUS NOT IN('CANCELADO','SALDADO')   AND usuariox=pusuario;
		UPDATE prestamoc SET estatusDC='A' WHERE dv>0 AND ESTATUS NOT IN('CANCELADO','SALDADO')   AND usuariox=pusuario;	
		UPDATE prestamoc SET estatusDC='L' WHERE Estatus2='LEGAL' AND ESTATUS NOT IN('CANCELADO','SALDADO')   AND usuariox=pusuario;
		UPDATE prestamoc SET estatusDC='C' WHERE Estatus2='CASTIGADO' AND ESTATUS NOT IN('CANCELADO','SALDADO')   AND usuariox=pusuario;	
	
END */$$
DELIMITER ;

/* Procedure structure for procedure `Prestamo_TablaAmortizacion` */

/*!50003 DROP PROCEDURE IF EXISTS  `Prestamo_TablaAmortizacion` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Prestamo_TablaAmortizacion`(
 pprestamo INT,
 pusuario INT
)
BEGIN
      CALL copiatablas(pprestamo,pusuario);      
      
      DROP TABLE IF EXISTS TablaAmortizacion;      
      CREATE TABLE TablaAmortizacion
      SELECT p.numero pnumero, p.fecha pfecha,  (SELECT SUM(capitalpendiente)-(SUM(capitalpendiente)*(p.gastolegales/SUM(capitalpendiente))) FROM cuotac WHERE prestamo=pprestamo AND usuariox=pusuario) pcapital, p.tasainteres ptasainteres, p.tasagastolegales ptasagastolegales, 
      p.sepaga psepaga, (SELECT COUNT(numero) FROM cuotac WHERE prestamo=pprestamo AND estatus IN('original','abonada')  AND usuariox=pusuario) pplazo, 
      p.metodo pmetodo, (SELECT SUM(capitalpendiente) FROM cuotac WHERE prestamo=pprestamo  AND usuariox=pusuario) ptotalcapital, 
      (SELECT SUM(interespendiente) FROM cuotac WHERE prestamo=pprestamo  AND usuariox=pusuario) pinteres, 
      (SELECT (SUM(capitalpendiente)-((p.tasagastolegales/100)*SUM(capitalpendiente)))  * (p.tasagastolegales/100) FROM cuotac WHERE prestamo=pprestamo  AND usuariox=pusuario) pGastoLegales, 
      (SELECT SUM(interespendiente+capitalpendiente) FROM cuotac WHERE prestamo=pprestamo AND usuariox=pusuario) pTotalsaldo,
      CONCAT(cl.nombre,' Tel:',cl.telefono,' Cel:',cl.celular) clnombre, 
      CONCAT(e.nombre,' Tel:',e.telefono) enombre, 
      c.numero cnumero, c.vencimiento cvencimiento, c.interespendiente cinteres, c.capitalpendiente ccapital, c.interespendiente+c.capitalpendiente ccuota,  c.cuota pcuota, 
      0000000000.00 cinteresacumulado, 00000000000.00 ctotalsaldo, 00000000000.00 ctotalcapital
      FROM prestamoc p, cuotac c, cliente cl,empleador e 
      WHERE p.cliente=cl.numero AND p.numero=c.prestamo AND p.numero=pprestamo  AND p.usuariox=pusuario
      AND cl.empleador=e.numero
      AND c.estatus IN('original','abonada')
      ORDER BY c.numero;
      
      
      
      
      SET @FIN=(SELECT  MAX(CNUMERO) FROM TablaAmortizacion WHERE PNUMERO=PPRESTAMO);
      SET @INICIO=1;
      WHILE @INICIO<=@FIN DO
	IF @INICIO=1 THEN      
		UPDATE TablaAmortizacion SET cinteresacumulado=CINTERES, 
		CtotalSaldo=pTotalsaldo-(cinteres+ccapital), ctotalcapital=ptotalcapital-ccapital
		WHERE PNUMERO=PPRESTAMO AND CNUMERO=1;
	ELSE
		SELECT SUM(CINTERES),pTotalsaldo-SUM(cinteres+ccapital),ptotalcapital-SUM(ccapital) INTO @IAcumulado,@tsaldo,@tcapital FROM TablaAmortizacion WHERE PNUMERO=PPRESTAMO AND CNUMERO<=@INICIO;		
		UPDATE TablaAmortizacion SET cinteresacumulado= @IAcumulado,
		ctotalsaldo=@tsaldo, ctotalcapital=@tcapital
		WHERE PNUMERO=PPRESTAMO AND CNUMERO=@INICIO;
	END IF;
	SET @INICIO=@INICIO+1;	
      END WHILE;
      
      SELECT * FROM TablaAmortizacion;
      
END */$$
DELIMITER ;

/* Procedure structure for procedure `procedimiento` */

/*!50003 DROP PROCEDURE IF EXISTS  `procedimiento` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `procedimiento`()
BEGIN

CREATE TABLE detalle  
SELECT pr.Numero prestamo, pr.fecha, pr.Vendedor vend, pr.cliente clie, ve.nombre Vendedor, cl.nombre Cliente, 
-- deuda
pr.gastolegales gasto, SUM(cu.mora) mora, SUM(cu.interes) interes, SUM(cu.interespendiente) interesp,
SUM(cu.capital) capital, SUM(cu.capitalpendiente) capitalp, SUM(cu.mora+cu.interes+capital) deuda,
-- pagado
(SELECT SUM(totalpagado) FROM maestrodepago WHERE prestamo=cu.prestamo) pagado,
-- saldo  
SUM(cu.mora+cu.interespendiente+cu.capitalpendiente) saldo,
-- parametros
co.filtro1,co.filtro2,co.filtro3,co.filtro4,co.filtro5,co.filtro36,co.filtro37,co.filtro31

FROM cuota cu, prestamo pr, cliente cl, sucursal su, vendedor ve, empleador em, usuario u, consulta co
WHERE cu.prestamo=pr.Numero
 AND pr.sucursal=su.numero	
 AND (pr.vendedor=ve.numero)
 AND (pr.cliente=cl.numero) 
 AND cl.empleador=em.numero
 and pr.usuario=u.numero
	
AND CASE co.filtro1 WHEN '' THEN 1=1 ELSE su.nombre=co.filtro1 END
AND CASE co.filtro2 WHEN '' THEN 1=1 ELSE em.nombre=co.filtro2 END
AND CASE co.filtro3 WHEN '' THEN 1=1 ELSE  ve.nombre=co.filtro3 END
AND CASE co.filtro5 WHEN '' THEN 1=1 ELSE u.nombre=co.filtro5 END
AND CASE co.filtro4 WHEN '' THEN pr.estatus IN("Original","Abonado","Saldado")
                    WHEN 'Original y Abonado' THEN pr.estatus IN("Original","Abonado") 
                    WHEN 'Legal' THEN pr.estatus2 IN("Legal") 
                    WHEN 'Castigado' THEN pr.estatus2 IN("Castigado") 
                    ELSE pr.estatus IN(co.filtro4) END
AND pr.fecha BETWEEN co.filtro36 AND co.filtro37
AND CASE co.filtro31 WHEN '' THEN 1=1 ELSE cl.nombre=co.filtro31 END	
AND co.reporte='prestamos'
GROUP BY cu.prestamo;




 CREATE TABLE subtotal
 SELECT vend, SUM(gasto) sgasto, SUM(mora) smora, SUM(interes) sinteres, SUM(interesp) sinteresp, SUM(capital) scapital, SUM(capitalp) scapitalp, 
 SUM(deuda) sdeuda, SUM(pagado) spagado, SUM(saldo) ssaldo, count(distinct(cliente)) scliente, count(distinct(prestamo)) sprestamo    
 FROM detalle
 GROUP BY vendedor ;
   
      
 CREATE TABLE total
 SELECT SUM(sgasto) tgasto, SUM(smora) tmora, SUM(sinteres) tinteres, SUM(sinteresp) tinteresp, SUM(scapital) tcapital, SUM(scapitalp) tcapitalp, 
 SUM(sdeuda) tdeuda, SUM(spagado) tpagado, SUM(ssaldo) tsaldo   
 FROM subtotal;
       

CREATE TABLE cantidad
SELECT COUNT(prestamo) cprestamo, COUNT(DISTINCT(vend)) cvendedor, COUNT(DISTINCT(clie)) ccliente
FROM detalle;      

SELECT * FROM detalle d,subtotal s,total t,cantidad c
WHERE d.vend=s.vend
order by d.vend, d.fecha;

DROP TABLE IF EXISTS detalle;
DROP TABLE IF EXISTS subtotal;
DROP TABLE IF EXISTS total;
DROP TABLE IF EXISTS cantidad;

END */$$
DELIMITER ;

/* Procedure structure for procedure `set_15_y_30` */

/*!50003 DROP PROCEDURE IF EXISTS  `set_15_y_30` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `set_15_y_30`(
pprestamo INT
)
BEGIN
UPDATE cuota SET vencimiento= 
CASE MONTH(vencimiento) WHEN 2 THEN        
    CASE WHEN DAY(vencimiento) <=15 THEN
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','15') 
    ELSE 
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','28')  
    END 
 ELSE
    CASE WHEN DAY(vencimiento) <=15 THEN
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','15') 
    ELSE 
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','30')  
    END  
 END
 
WHERE prestamo=pprestamo;
 
END */$$
DELIMITER ;

/* Procedure structure for procedure `set_15_y_30_temporal` */

/*!50003 DROP PROCEDURE IF EXISTS  `set_15_y_30_temporal` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `set_15_y_30_temporal`(
pprestamo INT
)
BEGIN
UPDATE cuotatemporal SET vencimiento= 
CASE MONTH(vencimiento) WHEN 2 THEN        
    CASE WHEN DAY(vencimiento) <=15 THEN
          CONCAT(YEAR(vencimiento),'-02-','15') -- ,MONTH(vencimiento),'-'
    ELSE 
          CONCAT(YEAR(vencimiento),'-02-','28') -- ,MONTH(vencimiento),'-' 
    END 
 ELSE
    CASE WHEN DAY(vencimiento) <=15 THEN
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','15') 
    ELSE 
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','30')  
    END  
 END
 WHERE prestamo=pprestamo;
 
END */$$
DELIMITER ;

/* Procedure structure for procedure `set_dia_igual` */

/*!50003 DROP PROCEDURE IF EXISTS  `set_dia_igual` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `set_dia_igual`(
pprestamo INT, vdia SMALLINT
)
BEGIN
UPDATE cuota SET vencimiento= 
CASE MONTH(vencimiento) WHEN 2 THEN 
    CASE WHEN vdia > 28 THEN
          CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-','28') 
    ELSE
        CONCAT(YEAR(vencimiento),'-',MONTH(vencimiento),'-',vdia) 
    END 
 ELSE
    CASE WHEN vdia > 30 THEN
